(382, 'd6f7dc815a6f8fda54803cd8b4577c50', '<p>The database activity module enables participants to create, maintain and search a collection of entries (i.e. records).  The structure of the entries is defined by the teacher as a number of fields. Field types include checkbox, radio buttons, dropdown menu, text area, URL, picture and uploaded file.</p>\n\n<p>The visual layout of information when listing, viewing or editing database entries may be controlled by database templates. Database activities may be shared between courses as presets and a teacher may also import and export database entries.</p>\n\n<p>If the database auto-linking filter is enabled, any entries in a database will be automatically linked where the words or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Database activities have many uses, such as</p>\n\n<ul><li>A collaborative collection of web links, books, book reviews, journal references etc</li>\n<li>For displaying student-created photos, posters, websites or poems for peer comment and review</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/data/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(383, 'fefa4554838e04046d58bf48f90b0e12', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(384, '90dcf135567d118017d3e6962514c326', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(385, 'fde77983b852f9561bf61860bbfe9775', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(386, 'b480f56ecc46b3d4eb8f78ccab8ec9d7', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(387, '85eecd04342eddfd580afa843c79dd6a', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(388, 'bc3729dfce1d3da44d961b1bde676a58', '<p>A SCORM package is a collection of files which are packaged according to an agreed standard for learning objects. The SCORM activity module enables SCORM or AICC packages to be uploaded as a zip file and added to a course.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a table of contents, with navigation buttons etc. SCORM activities generally include questions, with grades being recorded in the gradebook.</p>\n\n<p>SCORM activities may be used</p>\n\n<ul><li>For presenting multimedia content and animations</li>\n<li>As an assessment tool</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(389, 'a5a1a99c72640ca800864ca372124232', '<p>The survey activity module provides a number of verified survey instruments that have been found useful in assessing and stimulating learning in online environments. A teacher can use these to gather data from their students that will help them learn about their class and reflect on their own teaching.</p>\n\n<p>Note that these survey tools are pre-populated with questions. Teachers who wish to create their own survey should use the feedback activity module.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(390, 'dbfc85937cef992a74308685f4dad144', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(391, 'e30b3e08466c2612ba307d239cb78bbb', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(392, '7a5e7270f67eea01dda03bbe72a9175b', '<p>The book module enables a teacher to create a multi-page resource in a book-like format, with chapters and subchapters. Books can contain media files as well as text and are useful for displaying lengthy passages of information which can be broken down into sections.</p>\n\n<p>A book may be used</p>\n\n<ul><li>To display reading material for individual modules of study</li>\n<li>As a staff departmental handbook</li>\n<li>As a showcase portfolio of student work</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899161),
(393, '953e6015133022a4a97e3bea03e1cd32', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899162),
(394, 'bfb8dd8bac279ae0fef82dff69ac5a0a', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899162),
(395, '186bfadc705d6cf839948030a302997b', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899162),
(396, '7f709822319e416d02999c6bd63b861b', '<p>The label module enables text and multimedia to be inserted into the course page in between links to other resources and activities. Labels are very versatile and can help to improve the appearance of a course if used thoughtfully.</p>\n\n<p>Labels may be used</p>\n\n<ul><li>To split up a long list of activities with a subheading or an image</li>\n<li>To display an embedded sound file or video directly on the course page</li>\n<li>To add a short description to a course section</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899162),
(397, '3f885073cf2d192ea7455dbb79bb204e', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899162),
(398, '03b6daf740d65d589a2dbdf74b8eaa56', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899162),
(399, 'd3937bec08cd1972ef2b7eb405e8c01c', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1356936197),
(400, '7690de064ff078dd8890fa4a3d3f51c8', '<p>The assignment activity module enables a teacher to communicate tasks, collect work and provide grades and feedback.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents, spreadsheets, images, or audio and video clips. Alternatively, or in addition, the assignment may require students to type text directly into the text editor. An assignment can also be used to remind students of ''real-world'' assignments they need to complete offline, such as art work, and thus not require any digital content.</p>\n\n<p>When reviewing assignments, teachers can leave feedback comments and upload files, such as marked-up student submissions, documents with comments or spoken audio feedback. Assignments can be graded using a numerical or custom scale or an advanced grading method such as a rubric. Final grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/assignment/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(401, 'f3eb27a90dbba8db1c250d14701978a0', '<p>The chat activity module enables participants to have text-based, real-time synchronous discussions.</p>\n\n<p>The chat may be a one-time activity or it may be repeated at the same time each day or each week. Chat sessions are saved and can be made available for everyone to view or restricted to users with the capability to view chat session logs.</p>\n\n<p>Chats are especially useful when the group chatting is not able to meet face-to-face, such as</p>\n\n<ul><li>Regular meetings of students participating in online courses to enable them to share experiences with others in the same course but in a different location</li>\n<li>A student temporarily unable to attend in person chatting with their teacher to catch up with work</li>\n<li>Students out on work experience getting together to discuss their experiences with each other and their teacher</li>\n<li>Younger children using chat at home in the evenings as a controlled (monitored) introduction to the world of social networking</li>\n<li>A question and answer session with an invited speaker in a different location</li>\n<li>Sessions to help students prepare for tests where the teacher, or other students, would pose sample questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/chat/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(402, '976b9468f8637b570fc76bffa132f424', '<p>The choice activity module enables a teacher to ask a single question and offer a selection of possible responses.</p>\n\n<p>Choice results may be published after students have answered, after a certain date, or not at all. Results may be published with student names or anonymously.</p>\n\n<p>A choice activity may be used</p>\n\n<ul><li>As a quick poll to stimulate thinking about a topic</li>\n<li>To quickly test students'' understanding</li>\n<li>To facilitate student decision-making, for example allowing students to vote on a direction for the course</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/choice/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(403, 'cbc4a4718316373615988b215d9eb5f8', '<p>The database activity module enables participants to create, maintain and search a collection of entries (i.e. records).  The structure of the entries is defined by the teacher as a number of fields. Field types include checkbox, radio buttons, dropdown menu, text area, URL, picture and uploaded file.</p>\n\n<p>The visual layout of information when listing, viewing or editing database entries may be controlled by database templates. Database activities may be shared between courses as presets and a teacher may also import and export database entries.</p>\n\n<p>If the database auto-linking filter is enabled, any entries in a database will be automatically linked where the words or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Database activities have many uses, such as</p>\n\n<ul><li>A collaborative collection of web links, books, book reviews, journal references etc</li>\n<li>For displaying student-created photos, posters, websites or poems for peer comment and review</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/data/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(404, '14a63c9473abc7d401594984ebfd2dfb', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(405, 'a30f8cbc881988b8be8b110a49ac087a', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(406, 'c219460a35301285f1597e2d24d9a341', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(407, 'f698c6ba512bcdeb53f738252f9fdd1f', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899042),
(408, '25738daeb0e6127b53c22890acd83dca', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(409, 'ec67eece8a1ca5b5feb1911ba7bb479a', '<p>A SCORM package is a collection of files which are packaged according to an agreed standard for learning objects. The SCORM activity module enables SCORM or AICC packages to be uploaded as a zip file and added to a course.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a table of contents, with navigation buttons etc. SCORM activities generally include questions, with grades being recorded in the gradebook.</p>\n\n<p>SCORM activities may be used</p>\n\n<ul><li>For presenting multimedia content and animations</li>\n<li>As an assessment tool</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(410, 'ece40b59e11a43efb9a96981454143bc', '<p>The survey activity module provides a number of verified survey instruments that have been found useful in assessing and stimulating learning in online environments. A teacher can use these to gather data from their students that will help them learn about their class and reflect on their own teaching.</p>\n\n<p>Note that these survey tools are pre-populated with questions. Teachers who wish to create their own survey should use the feedback activity module.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(411, '42f1a0b8a8521a0c72915048e20e8d48', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(412, '7805b302a6d0c802916fac708728564b', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(413, '9f42cad444035f225ea4f584254112d0', '<p>The book module enables a teacher to create a multi-page resource in a book-like format, with chapters and subchapters. Books can contain media files as well as text and are useful for displaying lengthy passages of information which can be broken down into sections.</p>\n\n<p>A book may be used</p>\n\n<ul><li>To display reading material for individual modules of study</li>\n<li>As a staff departmental handbook</li>\n<li>As a showcase portfolio of student work</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(414, '7269e31564e26bd1b5eab0cbec263a7e', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(415, 'dbdbf90a95331615b2b37b95d6894648', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(416, 'c55fda2f3321afe93eb91af1fbaa9cfa', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(417, '60b274939cd5ccb20e50339456d2acd6', '<p>The label module enables text and multimedia to be inserted into the course page in between links to other resources and activities. Labels are very versatile and can help to improve the appearance of a course if used thoughtfully.</p>\n\n<p>Labels may be used</p>\n\n<ul><li>To split up a long list of activities with a subheading or an image</li>\n<li>To display an embedded sound file or video directly on the course page</li>\n<li>To add a short description to a course section</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(418, '34d57fda0b45e058716af525773ef89c', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(419, '9776e758a695c1049b2139e19459b0b1', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356896118/docs" />More help</a></div>\n', 1356899043),
(420, 'eabf6b3b7174fed8ae7b1031ef27745b', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/1/training_icon.gif" height="300" width="421" /></p>', 1356936049),
(421, 'e2a7426375dc52a9bdbd544e195aae7c', 'Next', 1356936064),
(422, '9a98a84f39cf7fee8b10f9611db9a10a', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1356936050);
INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(423, '2739a84f7aa3550801a6bc0c3bc81b55', '<table style="width: 1099px; height: 352px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<div><span style="font-size: small;"><img src="data:image/png;base64," alt="" height="232" width="1074" /></span></div>\r\n<div><span style="font-size: small;"> </span></div>\r\n<div><span style="font-size: small;">The Water and Sanitation Program (WSP) is a multi-donor partnership administered by the <a target="_blank" href="http://www.worldbank.org/">World Bank</a> to support poor people in obtaining affordable, safe and sustainable access to water and sanitation services.</span></div>\r\n<div><span style="font-size: small;"> </span></div>\r\n<div><span style="font-size: small;">We work directly with client governments at the local and national level in 25 countries through regional offices in Africa, East and South Asia, Latin America and the Caribbean, and in, Washington D.C. <span>WSP has led or supported many of the advances made within the water and sanitation sector over the last three decades.  We are able to share best practices across regions and place a strong focus on capacity-building by forming partnerships with academia, civil society organizations, donors, governments, media, private sector, and others.  Our work helps to effect the regulatory and structural changes needed for broad water and sanitation sector reform.</span></span></div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356901239);
INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(424, '5ba449190b9fdab34469200398daa50d', 'Previous', 1356931767),
(425, '3d010ea55fdf7bc038b774d65a7dbbd8', '<table style="width: 1118px; height: 234px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style="font-size: small;">Today, 2.5 billion people live without access to improved sanitation. Of these, 75 percent live in rural communities.  To address this challenge, WSP is working with governments and local private sectors to build capacity and strengthen performance monitoring, policy, financing, and other components needed to develop and institutionalize large scale, sustainable rural sanitation programs. With a focus on building a rigorous evidence base to support replication, WSP combines Community-Led Total Sanitation, behavior change communication, and sanitation marketing to generate sanitation demand and strengthen the supply of sanitation products and services, leading to improved health for people in rural areas.</span></p>\r\n<p><span style="font-size: small;">WSP taps into the financial and technical capacity of the domestic private sectorto help effectively manage and improve existing services and infrastructure. The Sustainable Services through Domestic Private Sector Participation (SS-DPSP) project supports WSP’s client governments to scale up the technical and financial capacity of the domestic private sector to help poor people gain sustained access to improved water supply and sanitation services.</span></p>\r\n</td>\r\n<td><img src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/3/images.jpeg" height="245" width="335" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356896561),
(426, 'b838ec0681011997f37adc9516c57972', '<p align=''center''>Previous</p>', 1356896561),
(427, '78fc6b9945207b67abd81d0dd3fb4066', '<p align=''center''>Next</p>', 1356896561),
(428, '99eba2514a6f95611cc8a002d091cf8b', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1356930795),
(429, 'dfcddc4085513d6a13f7ea5e2ac38da8', '<div class="no-overflow"><div><span style="font-size: small;"><span style="font-size: small;"><em>The <span style="font-size: small;"><em>Water and Sanitation (WSP)</em></span>is a multi-donor partnership administered by the World Bank to support poor people in obtaining affordable, safe and sustainable access to water and sanitation services.</em></span></span><em>We work directly with client governments at the local and national level in 25 countries through regional offices in Africa, East and South Asia, Latin America and the Caribbean, and in, Washington D.C.  </em><em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em>WSP has led or supported many of the advances made within the water and sanitation sector over the last three decades.  We are able to share best practices across regions and place a strong focus on capacity-building by forming partnerships with academia, civil society organizations, donors, governments, media, private sector, and others.  Our work helps to effect the regulatory and structural changes needed for broad water and sanitation sector reform.</em></div>\r\n<em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em>Our challenge is to replicate successful approaches, continue targeted learning efforts, and support reforms that ensure the adoption of sustainable investments in the sector that help people rise from poverty.</em></div>\r\n<em><span style="font-size: small;"><br /></span></em></div></div>', 1356930592),
(430, 'effd0e1d014ba2b69edb158a4f842977', '<p>The assignment activity module enables a teacher to communicate tasks, collect work and provide grades and feedback.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents, spreadsheets, images, or audio and video clips. Alternatively, or in addition, the assignment may require students to type text directly into the text editor. An assignment can also be used to remind students of ''real-world'' assignments they need to complete offline, such as art work, and thus not require any digital content.</p>\n\n<p>When reviewing assignments, teachers can leave feedback comments and upload files, such as marked-up student submissions, documents with comments or spoken audio feedback. Assignments can be graded using a numerical or custom scale or an advanced grading method such as a rubric. Final grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/assignment/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(431, '0fb717ebed0b929cdc50198ce69e9715', '<p>The chat activity module enables participants to have text-based, real-time synchronous discussions.</p>\n\n<p>The chat may be a one-time activity or it may be repeated at the same time each day or each week. Chat sessions are saved and can be made available for everyone to view or restricted to users with the capability to view chat session logs.</p>\n\n<p>Chats are especially useful when the group chatting is not able to meet face-to-face, such as</p>\n\n<ul><li>Regular meetings of students participating in online courses to enable them to share experiences with others in the same course but in a different location</li>\n<li>A student temporarily unable to attend in person chatting with their teacher to catch up with work</li>\n<li>Students out on work experience getting together to discuss their experiences with each other and their teacher</li>\n<li>Younger children using chat at home in the evenings as a controlled (monitored) introduction to the world of social networking</li>\n<li>A question and answer session with an invited speaker in a different location</li>\n<li>Sessions to help students prepare for tests where the teacher, or other students, would pose sample questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/chat/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(432, '3f4fc7b35b7184de3b50a46b92779a5f', '<p>The choice activity module enables a teacher to ask a single question and offer a selection of possible responses.</p>\n\n<p>Choice results may be published after students have answered, after a certain date, or not at all. Results may be published with student names or anonymously.</p>\n\n<p>A choice activity may be used</p>\n\n<ul><li>As a quick poll to stimulate thinking about a topic</li>\n<li>To quickly test students'' understanding</li>\n<li>To facilitate student decision-making, for example allowing students to vote on a direction for the course</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/choice/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(433, 'e337b09da65f8da96eab4ca754689b17', '<p>The database activity module enables participants to create, maintain and search a collection of entries (i.e. records).  The structure of the entries is defined by the teacher as a number of fields. Field types include checkbox, radio buttons, dropdown menu, text area, URL, picture and uploaded file.</p>\n\n<p>The visual layout of information when listing, viewing or editing database entries may be controlled by database templates. Database activities may be shared between courses as presets and a teacher may also import and export database entries.</p>\n\n<p>If the database auto-linking filter is enabled, any entries in a database will be automatically linked where the words or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Database activities have many uses, such as</p>\n\n<ul><li>A collaborative collection of web links, books, book reviews, journal references etc</li>\n<li>For displaying student-created photos, posters, websites or poems for peer comment and review</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/data/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(434, '0f6d65fd1ab29c16f2bef0144f952b9d', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(435, '9de0fc100049bbb3734f424e160daa21', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(436, '4bba7628cbed5ed245cad95f42d90db2', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(437, 'e6834c2c1e552713f9c6717d6fb8b47e', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(438, 'de8d99a08ab23d21fc395e63812bf611', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(439, '7f0890e0d08802ae1073b88113b7838b', '<p>A SCORM package is a collection of files which are packaged according to an agreed standard for learning objects. The SCORM activity module enables SCORM or AICC packages to be uploaded as a zip file and added to a course.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a table of contents, with navigation buttons etc. SCORM activities generally include questions, with grades being recorded in the gradebook.</p>\n\n<p>SCORM activities may be used</p>\n\n<ul><li>For presenting multimedia content and animations</li>\n<li>As an assessment tool</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(440, '9846f09836633c39c75237dc9b08fb70', '<p>The survey activity module provides a number of verified survey instruments that have been found useful in assessing and stimulating learning in online environments. A teacher can use these to gather data from their students that will help them learn about their class and reflect on their own teaching.</p>\n\n<p>Note that these survey tools are pre-populated with questions. Teachers who wish to create their own survey should use the feedback activity module.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(441, '396e1c759531192e4b2e73421195df4e', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(442, '0ca083d9492d4a06e0cb9c181877d30e', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(443, 'fb843e0c3e24b100b911bc60008d0d52', '<p>The book module enables a teacher to create a multi-page resource in a book-like format, with chapters and subchapters. Books can contain media files as well as text and are useful for displaying lengthy passages of information which can be broken down into sections.</p>\n\n<p>A book may be used</p>\n\n<ul><li>To display reading material for individual modules of study</li>\n<li>As a staff departmental handbook</li>\n<li>As a showcase portfolio of student work</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(444, '61bf3b21ff42fe85a9b6e455b40ac17c', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933105),
(445, 'f66ce2a4187629c3a8990833e0fb7c38', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933106),
(446, 'f1dbe04c049f254af1a04a033979a96e', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933106),
(447, 'b74e709109be87b8102cf562c35e0116', '<p>The label module enables text and multimedia to be inserted into the course page in between links to other resources and activities. Labels are very versatile and can help to improve the appearance of a course if used thoughtfully.</p>\n\n<p>Labels may be used</p>\n\n<ul><li>To split up a long list of activities with a subheading or an image</li>\n<li>To display an embedded sound file or video directly on the course page</li>\n<li>To add a short description to a course section</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933106),
(448, '9ebbf9c1b76df844cd24a41e155be88d', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933106),
(449, 'b90ad0e260116d23909c57f5e0e52e84', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356933106),
(450, 'a4c72d8e3297b313d658de3990340924', '<p>The assignment activity module enables a teacher to communicate tasks, collect work and provide grades and feedback.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents, spreadsheets, images, or audio and video clips. Alternatively, or in addition, the assignment may require students to type text directly into the text editor. An assignment can also be used to remind students of ''real-world'' assignments they need to complete offline, such as art work, and thus not require any digital content.</p>\n\n<p>When reviewing assignments, teachers can leave feedback comments and upload files, such as marked-up student submissions, documents with comments or spoken audio feedback. Assignments can be graded using a numerical or custom scale or an advanced grading method such as a rubric. Final grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/assignment/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(451, 'c47beb9e6a11f32a2182c0af8787c521', '<p>The chat activity module enables participants to have text-based, real-time synchronous discussions.</p>\n\n<p>The chat may be a one-time activity or it may be repeated at the same time each day or each week. Chat sessions are saved and can be made available for everyone to view or restricted to users with the capability to view chat session logs.</p>\n\n<p>Chats are especially useful when the group chatting is not able to meet face-to-face, such as</p>\n\n<ul><li>Regular meetings of students participating in online courses to enable them to share experiences with others in the same course but in a different location</li>\n<li>A student temporarily unable to attend in person chatting with their teacher to catch up with work</li>\n<li>Students out on work experience getting together to discuss their experiences with each other and their teacher</li>\n<li>Younger children using chat at home in the evenings as a controlled (monitored) introduction to the world of social networking</li>\n<li>A question and answer session with an invited speaker in a different location</li>\n<li>Sessions to help students prepare for tests where the teacher, or other students, would pose sample questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/chat/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(452, 'd3ed3ea3709bb288476539008bbfea1e', '<p>The choice activity module enables a teacher to ask a single question and offer a selection of possible responses.</p>\n\n<p>Choice results may be published after students have answered, after a certain date, or not at all. Results may be published with student names or anonymously.</p>\n\n<p>A choice activity may be used</p>\n\n<ul><li>As a quick poll to stimulate thinking about a topic</li>\n<li>To quickly test students'' understanding</li>\n<li>To facilitate student decision-making, for example allowing students to vote on a direction for the course</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/choice/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
