(454, 'ee0a95a174814cab6ac753f06830f5a3', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(455, 'bdf1feb5ab4b8308cf3f907ed0340fce', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(456, 'd3667745197dcfccfcde493c6b9416ac', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(457, 'd20bdc79ffa8820aedcaced6ea935d45', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(458, 'c8ccfe7de40fd0551ddef6f5ace9e5aa', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(459, '7ee8427da8541b227f0e5af94bfbd5f0', '<p>A SCORM package is a collection of files which are packaged according to an agreed standard for learning objects. The SCORM activity module enables SCORM or AICC packages to be uploaded as a zip file and added to a course.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a table of contents, with navigation buttons etc. SCORM activities generally include questions, with grades being recorded in the gradebook.</p>\n\n<p>SCORM activities may be used</p>\n\n<ul><li>For presenting multimedia content and animations</li>\n<li>As an assessment tool</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(460, '0665de569f4215f36ac59b4e0bca5d15', '<p>The survey activity module provides a number of verified survey instruments that have been found useful in assessing and stimulating learning in online environments. A teacher can use these to gather data from their students that will help them learn about their class and reflect on their own teaching.</p>\n\n<p>Note that these survey tools are pre-populated with questions. Teachers who wish to create their own survey should use the feedback activity module.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(461, '48298d6b16eef90cb55bfcf4c1495260', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(462, '51b87d6fc145ee7375918b9889ae365d', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(463, 'e67833e3fd5020f57844e156a3078156', '<p>The book module enables a teacher to create a multi-page resource in a book-like format, with chapters and subchapters. Books can contain media files as well as text and are useful for displaying lengthy passages of information which can be broken down into sections.</p>\n\n<p>A book may be used</p>\n\n<ul><li>To display reading material for individual modules of study</li>\n<li>As a staff departmental handbook</li>\n<li>As a showcase portfolio of student work</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930981),
(464, 'bcf5e30d0b82a5ec4dfc24f69104f201', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930982),
(465, '22e9b7cb649307e211c22f7c0f681ad9', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930982),
(466, '7ab09971c5a1d8e4bc739a794594bfd2', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930982),
(467, '45ab87f3c71fa10c3d4be3aee5edab0e', '<p>The label module enables text and multimedia to be inserted into the course page in between links to other resources and activities. Labels are very versatile and can help to improve the appearance of a course if used thoughtfully.</p>\n\n<p>Labels may be used</p>\n\n<ul><li>To split up a long list of activities with a subheading or an image</li>\n<li>To display an embedded sound file or video directly on the course page</li>\n<li>To add a short description to a course section</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930982);
INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(468, 'd1a0e6172044a08bdfba9e8543f3e912', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930982),
(469, 'cfafcbd4f736cbeda8553681acc96f41', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />More help</a></div>\n', 1356930982),
(470, 'f468e42b7dd87ce8485195a2f900da02', '<div class="no-overflow"><div><span style="font-size: small;"><span style="font-size: small;"><em>The <span style="font-size: small;"><em><a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">Water and Sanitation</a> (WSP)</em></span>is a multi-donor partnership administered by the World Bank to support poor people in obtaining affordable, safe and sustainable access to <a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">water and sanitation</a> services.</em></span></span><em>We work directly with client governments at the local and national level in 25 countries through regional offices in Africa, East and South Asia, Latin America and the Caribbean, and in, Washington D.C.  </em><em><span style="font-size: small;"><span style="font-size: small;"></span></span></em><div><em> </em></div><em><span style="font-size: small;"><span style="font-size: small;"></span></span></em><div><em>WSP has led or supported many of the advances made within the <a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">water and sanitation</a> sector over the last three decades.  We are able to share best practices across regions and place a strong focus on capacity-building by forming partnerships with academia, civil society organizations, donors, governments, media, private sector, and others.  Our work helps to effect the regulatory and structural changes needed for broad <a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">water and sanitation</a> sector reform.</em></div><em><span style="font-size: small;"><span style="font-size: small;"></span></span></em><div><em> </em></div><em><span style="font-size: small;"><span style="font-size: small;"></span></span></em><div><em>Our challenge is to replicate successful approaches, continue targeted learning efforts, and support reforms that ensure the adoption of sustainable investments in the sector that help people rise from poverty.</em></div><em><span style="font-size: small;"><br /></span></em></div></div>', 1356900278),
(471, 'c3d3eabf6b0816a1191f10aec69efed8', '<table style="width: 1066px; height: 242px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><span style="font-size: small;">Today, 2.5 billion people live without access to improved sanitation. Of these, 75 percent live in rural communities.  To address this challenge, WSP is working with governments and local private sectors to build capacity and strengthen performance monitoring, policy, financing, and other components needed to develop and institutionalize large scale, sustainable rural sanitation programs. With a focus on building a rigorous evidence base to support replication, WSP combines Community-Led Total Sanitation, behavior change communication, and sanitation marketing to generate sanitation demand and strengthen the supply of sanitation products and services, leading to improved health for people in rural areas.</span><br /><br /><span style="font-size: small;">WSP taps into the financial and technical capacity of the domestic private sectorto help effectively manage and improve existing services and infrastructure. The Sustainable Services through Domestic Private Sector Participation (SS-DPSP) project supports WSP’s client governments to scale up the technical and financial capacity of the domestic private sector to help poor people gain sustained access to improved water supply and sanitation services.</span></td>\r\n<td><img src="http://localhost/moodle/brokenfile.php#/5/user/draft/753326416/images.jpeg" height="245" width="335" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356901414);
INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(472, '36eec411ff08d0f76e87fbe266d78f84', '<table style="width: 1149px; height: 194px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style="font-weight: normal; font-family: Helvetica,Verdana,Sans-Serif; font-size: small;">Diarrhea remains one of the main threats to child health and well-being in the developing world – each year killing nearly two million children under five and causing more than five billion disease episodes.  Washing hands with soap at critical times – after contact with feces and before handling food – could reduce diarrheal rates by up to 47 percent (Curtis and Cairncross, 2003). However, rates of handwashing with soap remain low throughout the developing world and large-scale promotion of handwashing behavior change is a challenge.</span></p>\r\n<div style="margin: 0.1pt 0in;"><span style="font-size: small;"><span style="font-weight: normal; font-family: Helvetica,Verdana,Sans-Serif;"><span style="color: black;">Global Scaling Up Handwashing is a WSP project focused on learning how to apply innovative promotional approaches to behavior change to generate widespread and sustained improvements in handwashing with soap at scale among women of reproductive age (ages 15-49) and primary school-aged children (ages 5-9). The project is being implemented by local and national governments with technical support from WSP. It is currently being tested in Peru, Senegal, Tanzania, and Vietnam. This project builds on national campaigns initiated by the </span></span><span style="color: black; font-family: ''Arial'',''sans-serif'';"><a href="http://www.globalhandwashing.org" target="_blank"><span style="font-weight: normal; font-family: Helvetica,Verdana,Sans-Serif;">Public-Private Partnership for Handwashing</span></a></span><span style="font-weight: normal; font-family: Helvetica,Verdana,Sans-Serif;"><span style="color: black;"> (PPPHW).</span></span></span></div>\r\n<p><span style="font-weight: normal; font-size: small; font-family: Helvetica,Verdana,Sans-Serif;"> </span></p>\r\n</td>\r\n<td><img src="data:image/png;base64," alt="" height="193" width="385" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356901615);
INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(473, 'a1f8e9755e0b25f6b4367491baeed1be', '<table style="width: 1134px; height: 224px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style="font-size: small;">Developing countries are the least equipped to respond to impacts of climate change today on basic services such as water and sanitation, where deficits already exist. To help develop institutional mechanisms and capacities and inform policies on climate-related impacts on water and sanitation for the poor, WSP is working to mainstream climate-smart WSS planning, conduct research, compile data and knowledge, harmonize sector players, and build capacity of WSP clients and partners.</span></p>\r\n<p><span style="font-size: small;">Fragile States are the countries at greatest risk of not meeting the MDGs. After the crises have passed, these countries face a great need for strengthened policies, capacity, and infrastructure to provide sustained WSS services. WSP is addressing the need, collaborating with <a class="autolink" title="Sanitation and Water for All" href="http://localhost/moodle/mod/lesson/view.php?id=8">Sanitation and Water for All</a> partners (developing countries, implementation agencies, and donors) to increase political prioritization of WSS, promote evidence-based decision making, and support strong national processes.</span></p>\r\n<p><span style="font-size: small;">Many cities have low water quality, unreliable supply, and distorted prices that burden consumers, especially the poor. WSP supports sub-national governments and public and private WSS providers, working to improve water supply in dense urban, peri-urban areas, and small towns by developing pro-poor policies, guidelines, and models for improved.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">\r\n<p align="center"></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356901694),
(474, '96d3a9b93ac0ca75e4236c4bed4fdd66', '<p>ConclusionConclusionConclusionConclusionConclusionConclusionConclusionConclusionConclusion</p>', 1356926874),
(475, 'aa416fbd57d93ab8c3e3e1504f9f2d30', 'Start Again', 1356926874),
(476, 'e479847e7e9db417a20c1ad473fe7c5b', 'Quiz Start', 1356926874),
(477, '20ebbf0632cd9b0b42658b00d28cad2c', '<table style="width: 348px; height: 22px;" align="center" border="0">\r\n<tbody>\r\n<tr>\r\n<td><img src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/7/quiz.jpeg" height="309" width="545" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356901808),
(478, '6aa4a1c15684f40368b61a3e91cb55f0', '<p><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">The<span class="nolink"> <span class="autolink">Water and Sanitation</span></span> Program (WSP) is a multi-donor partnership administered by the</span></p>', 1356901938),
(479, '2de2d420acfca252ebd66d3e5b150981', 'Asian Development Bank', 1356901939),
(480, '59884baabd1e90ae275f8f7616fc7ff9', 'Dutch Bangla Bank', 1356901939),
(481, 'c650fc1d9710d535a1e75b5a133bbed2', 'Islamic Development Bank', 1356901939),
