(484, 'fd91ffb16ea4f858062aac46d31739fd', '<p><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">The <span class="autolink"><a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">Water and Sanitation</a></span> Program (WSP) i</span><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">s to support poor people in obtaining affordable, safe and sustainable access to <span class="autolink"><a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">water and sanitation</a></span> services.</span></p>', 1356900322),
(485, '84223e9633fe0695e273566675b0f36c', 'True', 1356900322),
(486, '013d32f40d6667b114de7748bdfa738f', 'False', 1356900322),
(487, '8f56cfe3e235da2ca08b0788da60a3f3', '<div class="no-overflow"><p><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">The <span class="autolink"><a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">Water and Sanitation</a></span> Program (WSP) i</span><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">s to support poor people in obtaining affordable, safe and sustainable access to <span class="autolink"><a class="autolink" title="Water and Sanitation" href="http://localhost/moodle/mod/lesson/view.php?id=8">water and sanitation</a></span> services.</span></p></div>', 1356900326),
