(513, 'ccfb9349b26b7194bb37b0e2b790515e', '<table style="width: 872px; height: 139px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><span style="font-size: small;">Today, 2.5 billion people live without access to improved sanitation. Of these, 75 percent live in rural communities.  To address this challenge, WSP is working with governments and local private sectors to build capacity and strengthen performance monitoring, policy, financing, and other components needed to develop and institutionalize large scale, sustainable rural sanitation programs. With a focus on building a rigorous evidence base to support replication, WSP combines Community-Led Total Sanitation, behavior change communication, and sanitation marketing to generate sanitation demand and strengthen the supply of sanitation products and services, leading to improved health for people in rural areas.</span><br /><br /><span style="font-size: small;">WSP taps into the financial and technical capacity of the domestic private sectorto help effectively manage and improve existing services and infrastructure. The Sustainable Services through Domestic Private Sector Participation (SS-DPSP) project supports WSP’s client governments to scale up the technical and financial capacity of the domestic private sector to help poor people gain sustained access to improved water supply and sanitation services.</span></td>\r\n<td><object height="300" width="400"><param name="movie" value="http://localhost/moodle/brokenfile.php#/5/user/draft/559631348/demo.flv" /><embed src="http://localhost/moodle/brokenfile.php#/5/user/draft/559631348/demo.flv" height="300" width="400" /> </object></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356917111),
(514, 'f634c2b91de0948b8f19d395ffb8b611', '<table style="width: 872px; height: 139px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><span style="font-size: small;">Today, 2.5 billion people live without access to improved sanitation. Of these, 75 percent live in rural communities.  To address this challenge, WSP is working with governments and local private sectors to build capacity and strengthen performance monitoring, policy, financing, and other components needed to develop and institutionalize large scale, sustainable rural sanitation programs. With a focus on building a rigorous evidence base to support replication, WSP combines Community-Led Total Sanitation, behavior change communication, and sanitation marketing to generate sanitation demand and strengthen the supply of sanitation products and services, leading to improved health for people in rural areas.</span><br /><br /><span style="font-size: small;">WSP taps into the financial and technical capacity of the domestic private sectorto help effectively manage and improve existing services and infrastructure. The Sustainable Services through Domestic Private Sector Participation (SS-DPSP) project supports WSP’s client governments to scale up the technical and financial capacity of the domestic private sector to help poor people gain sustained access to improved water supply and sanitation services.</span></td>\r\n<td><object height="300" width="400"><param name="movie" value="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/14/demo33.flv" /><embed src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/14/demo33.flv" height="300" width="400" /> </object></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356926854),
(515, '326306848a954cc9d35cd3a2c069d3fd', '<table style="width: 729px; height: 39px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><img src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/4/SWASHTHA-Logo.jpg" height="345" width="781" /></td>\r\n</tr>\r\n<tr>\r\n<td class="shoulder">\r\n<div class="threeCol pageMiddle widgetDragable white">\r\n<div class="adWidget widget-740">\r\n<div style="display: block;" class="dn commonAdClass adz-pageTop adz-285"></div>\r\n</div>\r\n</div>\r\n<span style="font-size: medium;">বাংলাদেশি পোশাকের বিদেশি ক্রেতারা আশুলিয়ায় তাজরীন ফ্যাশনসে অগ্নিকাণ্ড এবং ১১১ জন শ্রমিকের মৃত্যুকে একধরনের সতর্কসংকেত মনে করছেন। ক্রেতারা কারখানাতে অগ্নিনিরাপত্তার দ্রুত মানোন্নয়ন করার তাগিদ দিয়েছেন। এ ক্ষেত্রে তাঁরা সরকারের কাছে নিরাপত্তা নিশ্চিত করার অঙ্গীকারও চেয়েছেন।</span><br /><span style="font-size: medium;">অগ্নিনিরাপত্তা তৈরিতে করণীয় নির্ধারণের ক্ষেত্রে তৈরি পোশাক মালিক সমিতি বিজিএমইএ টাস্কফোর্স গঠনের সিদ্ধান্ত জানিয়েছে। আর ক্রেতারা এ টাস্কফোর্সে বিদেশি অডিট প্রতিষ্ঠান, আইনজ্ঞ, স্থপতি ও প্রকৌশলীদের সম্পৃক্ত করার প্রস্তাব দিয়েছেন।</span><br /><span style="font-size: medium;">বিজিএমইএর আয়োজনে তৈরি পোশাকের বিদেশি ক্রেতাদের এক বৈঠকে আন্তর্জাতিক খ্যাতনামা সব প্রতিষ্ঠানের প্রতিনিধিরা গতকাল শুক্রবার এসব মতামত দেন। ক্রেতারা সভায় কারখানা চলাকালে ভবনের সব ধরনের দরজা উন্মুক্ত রাখা এবং ভবন নির্মাণবিধি ও অগ্নিনির্বাপণ প্রত্যয়নপত্র নিশ্চিত করতে তাগিদ দিয়েছেন। কোনো কোনো ক্রেতা প্রতিষ্ঠানের প্রতিনিধি দীর্ঘ মেয়াদে টাস্কফোর্সের সুপারিশ ধরে শ্রমিকের মজুরি বা শ্রমমূল্য বাড়ানোর তাগিদ দিয়েছেন।</span><br /><span style="font-size: medium;">অন্যদিকে বিজিএমইএ ক্রেতাদের কাছে পোশাকের মূল্য বাড়ানোর প্রস্তাব করেছে। জবাবে ক্রেতারা বলেছেন, ভালো প্রস্তাব। তবে এটা ক্রেতা-বিক্রেতার নিজেদের মধ্যকার চুক্তির বিষয়।</span></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356925796),
(516, '4239cf1a16653588fabaf2ec7035061f', '<table style="width: 841px; height: 610px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><img style="display: block; margin-left: auto; margin-right: auto;" src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/4/SWASHTHA-Logo.jpg" height="327" width="683" /></td>\r\n</tr>\r\n<tr>\r\n<td class="shoulder">\r\n<div class="threeCol pageMiddle widgetDragable white">\r\n<div class="adWidget widget-740">\r\n<div style="display: block;" class="dn commonAdClass adz-pageTop adz-285"></div>\r\n</div>\r\n</div>\r\n<span style="font-size: medium;">বাংলাদেশি পোশাকের বিদেশি ক্রেতারা আশুলিয়ায় তাজরীন ফ্যাশনসে অগ্নিকাণ্ড এবং ১১১ জন শ্রমিকের মৃত্যুকে একধরনের সতর্কসংকেত মনে করছেন। ক্রেতারা কারখানাতে অগ্নিনিরাপত্তার দ্রুত মানোন্নয়ন করার তাগিদ দিয়েছেন। এ ক্ষেত্রে তাঁরা সরকারের কাছে নিরাপত্তা নিশ্চিত করার অঙ্গীকারও চেয়েছেন।</span><br /><span style="font-size: medium;">অগ্নিনিরাপত্তা তৈরিতে করণীয় নির্ধারণের ক্ষেত্রে তৈরি পোশাক মালিক সমিতি বিজিএমইএ টাস্কফোর্স গঠনের সিদ্ধান্ত জানিয়েছে। আর ক্রেতারা এ টাস্কফোর্সে বিদেশি অডিট প্রতিষ্ঠান, আইনজ্ঞ, স্থপতি ও প্রকৌশলীদের সম্পৃক্ত করার প্রস্তাব দিয়েছেন।</span><br /><span style="font-size: medium;">বিজিএমইএর আয়োজনে তৈরি পোশাকের বিদেশি ক্রেতাদের এক বৈঠকে আন্তর্জাতিক খ্যাতনামা সব প্রতিষ্ঠানের প্রতিনিধিরা গতকাল শুক্রবার এসব মতামত দেন। ক্রেতারা সভায় কারখানা চলাকালে ভবনের সব ধরনের দরজা উন্মুক্ত রাখা এবং ভবন নির্মাণবিধি ও অগ্নিনির্বাপণ প্রত্যয়নপত্র নিশ্চিত করতে তাগিদ দিয়েছেন। কোনো কোনো ক্রেতা প্রতিষ্ঠানের প্রতিনিধি দীর্ঘ মেয়াদে টাস্কফোর্সের সুপারিশ ধরে শ্রমিকের মজুরি বা শ্রমমূল্য বাড়ানোর তাগিদ দিয়েছেন।</span><br /><span style="font-size: medium;">অন্যদিকে বিজিএমইএ ক্রেতাদের কাছে পোশাকের মূল্য বাড়ানোর প্রস্তাব করেছে। জবাবে ক্রেতারা বলেছেন, ভালো প্রস্তাব। তবে এটা ক্রেতা-বিক্রেতার নিজেদের মধ্যকার চুক্তির বিষয়।</span></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356936072),
(517, '00c05f121a231485d0175ac4c82923fb', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1356933726),
(518, '1df43f57b1f3524ffab1c42fa424bb4b', '<div class="no-overflow"><div><span style="font-size: small;"><span style="font-size: small;"><em>The <span style="font-size: small;"><em>Water and Sanitation (WSP)</em></span>is a multi-donor partnership administered by the World Bank to support poor people in obtaining affordable, safe and sustainable access to water and sanitation services.</em></span></span><em>We work directly with client governments at the local and national level in 25 countries through regional offices in Africa, East and South Asia, Latin America and the Caribbean, and in, Washington D.C.  </em><em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em>WSP has led or supported many of the advances made within the water and sanitation sector over the last three decades.  We are able to share best practices across regions and place a strong focus on capacity-building by forming partnerships with academia, civil society organizations, donors, governments, media, private sector, and others.  Our work helps to effect the regulatory and structural changes needed for broad water and sanitation sector reform.</em></div>\r\n<em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size: small;"><span style="font-size: small;"></span></span></em>\r\n<div><em>Our challenge is to replicate successful approaches, continue targeted learning efforts, and support reforms that ensure the adoption of sustainable investments in the sector that help people rise from poverty.</em></div>\r\n<em><span style="font-size: small;"><br /></span></em></div></div>', 1356929604),
(519, 'f870c0a13b755624fae427fbba97cc2d', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1356928214),
(520, 'f41f2db39328bd285acb8f9692cdf003', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/1/training_icon.gif" height="300" width="421" /></p>', 1356928020),
(521, '49ed2783b3931bf41374637d4ecb6644', 'Next', 1356928096),
(522, '12241a50eca2dc6494d1a932dcd13845', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1356928165);
