(527, '01002be60c2fbd997077f46cb09843d5', '<table style="width: 841px; height: 610px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><img style="display: block; margin-left: auto; margin-right: auto;" src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/4/SWASHTHA-Logo.jpg" height="327" width="683" /></td>\r\n</tr>\r\n<tr>\r\n<td class="shoulder">\r\n<div class="threeCol pageMiddle widgetDragable white">\r\n<div class="adWidget widget-740">\r\n<div style="display: block;" class="dn commonAdClass adz-pageTop adz-285"></div>\r\n</div>\r\n</div>\r\n<span style="font-size: medium;">বাংলাদেশি পোশাকের বিদেশি ক্রেতারা আশুলিয়ায় তাজরীন ফ্যাশনসে অগ্নিকাণ্ড এবং ১১১ জন শ্রমিকের মৃত্যুকে একধরনের সতর্কসংকেত মনে করছেন। ক্রেতারা কারখানাতে অগ্নিনিরাপত্তার দ্রুত মানোন্নয়ন করার তাগিদ দিয়েছেন। এ ক্ষেত্রে তাঁরা সরকারের কাছে নিরাপত্তা নিশ্চিত করার অঙ্গীকারও চেয়েছেন।</span><br /><span style="font-size: medium;">অগ্নিনিরাপত্তা তৈরিতে করণীয় নির্ধারণের ক্ষেত্রে তৈরি পোশাক মালিক সমিতি বিজিএমইএ টাস্কফোর্স গঠনের সিদ্ধান্ত জানিয়েছে। আর ক্রেতারা এ টাস্কফোর্সে বিদেশি অডিট প্রতিষ্ঠান, আইনজ্ঞ, স্থপতি ও প্রকৌশলীদের সম্পৃক্ত করার প্রস্তাব দিয়েছেন।</span><br /><span style="font-size: medium;">বিজিএমইএর আয়োজনে তৈরি পোশাকের বিদেশি ক্রেতাদের এক বৈঠকে আন্তর্জাতিক খ্যাতনামা সব প্রতিষ্ঠানের প্রতিনিধিরা গতকাল শুক্রবার এসব মতামত দেন। ক্রেতারা সভায় কারখানা চলাকালে ভবনের সব ধরনের দরজা উন্মুক্ত রাখা এবং ভবন নির্মাণবিধি ও অগ্নিনির্বাপণ প্রত্যয়নপত্র নিশ্চিত করতে তাগিদ দিয়েছেন। কোনো কোনো ক্রেতা প্রতিষ্ঠানের প্রতিনিধি দীর্ঘ মেয়াদে টাস্কফোর্সের সুপারিশ ধরে শ্রমিকের মজুরি বা শ্রমমূল্য বাড়ানোর তাগিদ দিয়েছেন।</span><br /><span style="font-size: medium;">অন্যদিকে বিজিএমইএ ক্রেতাদের কাছে পোশাকের মূল্য বাড়ানোর প্রস্তাব করেছে। জবাবে ক্রেতারা বলেছেন, ভালো প্রস্তাব। তবে এটা ক্রেতা-বিক্রেতার নিজেদের মধ্যকার চুক্তির বিষয়।</span></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356928046),
(528, '4862510416bc244683658af4dde95f21', '<table style="width: 848px; height: 224px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style="font-size: small;">Developing countries are the least equipped to respond to impacts of climate change today on basic services such as water and sanitation, where deficits already exist. To help develop institutional mechanisms and capacities and inform policies on climate-related impacts on water and sanitation for the poor, WSP is working to mainstream climate-smart WSS planning, conduct research, compile data and knowledge, harmonize sector players, and build capacity of WSP clients and partners.</span></p>\r\n<p><span style="font-size: small;">Fragile States are the countries at greatest risk of not meeting the MDGs. After the crises have passed, these countries face a great need for strengthened policies, capacity, and infrastructure to provide sustained WSS services. WSP is addressing the need, collaborating with <a class="autolink" title="Sanitation and Water for All" href="http://localhost/moodle/mod/lesson/view.php?id=8">Sanitation and Water for All</a> partners (developing countries, implementation agencies, and donors) to increase political prioritization of WSS, promote evidence-based decision making, and support strong national processes.</span></p>\r\n<p><span style="font-size: small;">Many cities have low water quality, unreliable supply, and distorted prices that burden consumers, especially the poor. WSP supports sub-national governments and public and private WSS providers, working to improve water supply in dense urban, peri-urban areas, and small towns by developing pro-poor policies, guidelines, and models for improved.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">\r\n<p align="center"></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356928096),
