(556, '2c14a5b4abf8b4ea7d7c9cb2e1315c67', '<div class="no-overflow"><div><span style="font-size:small;"><span style="font-size:small;"><em>The <span style="font-size:small;"><em>Water and Sanitation (WSP)</em></span>is a multi-donor partnership administered by the World Bank to support poor people in obtaining affordable, safe and sustainable access to water and sanitation services.</em></span></span><em>We work directly with client governments at the local and national level in 25 countries through regional offices in Africa, East and South Asia, Latin America and the Caribbean, and in, Washington D.C.  </em><em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em>WSP has led or supported many of the advances made within the water and sanitation sector over the last three decades.  We are able to share best practices across regions and place a strong focus on capacity-building by forming partnerships with academia, civil society organizations, donors, governments, media, private sector, and others.  Our work helps to effect the regulatory and structural changes needed for broad water and sanitation sector reform.</em></div>\r\n<em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em>Our challenge is to replicate successful approaches, continue targeted learning efforts, and support reforms that ensure the adoption of sustainable investments in the sector that help people rise from poverty.</em></div>\r\n<em><span style="font-size:small;"><br /></span></em></div></div>', 1356928580),
(557, 'b177a197154dec0fa9d403acaebd7d45', '<div class="no-overflow"><div><span style="font-size:small;"><span style="font-size:small;"><em>The <span style="font-size:small;"><em>Water and Sanitation (WSP)</em></span>is a multi-donor partnership administered by the World Bank to support poor people in obtaining affordable, safe and sustainable access to water and sanitation services.</em></span></span><em>We work directly with client governments at the local and national level in 25 countries through regional offices in Africa, East and South Asia, Latin America and the Caribbean, and in, Washington D.C.  </em><em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em>WSP has led or supported many of the advances made within the water and sanitation sector over the last three decades.  We are able to share best practices across regions and place a strong focus on capacity-building by forming partnerships with academia, civil society organizations, donors, governments, media, private sector, and others.  Our work helps to effect the regulatory and structural changes needed for broad water and sanitation sector reform.</em></div>\r\n<em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em> </em></div>\r\n<em><span style="font-size:small;"><span style="font-size:small;"></span></span></em>\r\n<div><em>Our challenge is to replicate successful approaches, continue targeted learning efforts, and support reforms that ensure the adoption of sustainable investments in the sector that help people rise from poverty.</em></div>\r\n<em><span style="font-size:small;"><br /></span></em></div></div>', 1356928598),
(558, 'f9466d91f8d09f23eed78197db8d1873', '<div class="no-overflow"><div><span style="font-size: small;"><span style="font-size: small;"><em></em></span></span><em><em><span style="font-size: small;"></span></em></em>\r\n<div class="summary">\r\n<div class="no-overflow">\r\n<p><span style="font-size: medium;">আমরা এই কোর্সে যে যে বিষয় সম্পর্কে জ্ঞান লাভ করব তা হলোঃ বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে? সংবাদপত্র মুখ্যত দৈনন্দিন ঘটনার খবর ছাপে—যেগুলো জনসমক্ষে ঘটে আর যে চাপা খবরগুলো ফাঁস হয় সেগুলো। হাসির চেয়ে কান্নার, জন্মের চেয়ে মৃত্যুর অভিঘাত যেমন প্রবল, তেমনি পাঠককে নাড়া দেওয়ার ক্ষমতা বেশি দুঃসংবাদেরই। মানুষের বিবেককে তার শ্রেষ্ঠ সম্পদ ভাবা হয়। সেই বিবেক সম্পদে-আনন্দে তেমন সাড়া দেয় না, জাগ্রত হয় মানুষের সংকটে-বিপদে।<br />একসময় ঢাকাকে বলা হতো মসজিদের নগর, এখন বলা যাবে গণমাধ্যমের নগর। শুনেছি, ছোট-বড় ২০০ বা তার বেশি পত্রিকার ডিক্লারেশন আছে, বেসরকারি চ্যানেলের সংখ্যা কুড়িতে পৌঁছেছে। না, পৃথিবীর ধনী দেশ যাদের নাগরিকদের পরার ও কেনার ক্ষমতা আমাদের চেয়ে অনেক বেশি, তাদের কোথাও গণমাধ্যমের এ রকম বান ডাকেনি। সেসব দেশে এলাকাভিত্তিক ছোট ছোট অসংখ্য কাগজ আছে, যারা নিজ এলাকার ঘটনাগুলো ছাপে—তাতে সুসংবাদই থাকে বেশি। জাতীয় দৈনিক হওয়ার অভিলাষ ও ক্ষমতা তাদের সবার থাকে না—সেটি যেখান থেকেই প্রকাশিত হোক।</span><span style="font-size: medium; font-family: verdana,arial,helvetica,sans-serif; color: #000000;"></span><em><span style="font-size: small;"><br /></span></em></p>\r\n</div>\r\n</div>\r\n</div></div>', 1356938942);
