(562, 'f15c1286937b98bb4068cad59e1ba07e', '<table style="width: 872px; height: 139px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><span style="font-size: small;"></span><span style="font-size: medium;">কিন্তু আমাদের এখানে কেউই নিজ এলাকায় সেবা দিয়ে সন্তুষ্ট হন না, সবাই ‘জাতীয় দায়িত্ব’ পালন করতে চান। বিন্দুতেই যে সিন্ধু হয়, সে বিশ্বাস আমাদের নেই। সবাই যেন প্রতিযোগিতায় নেমেছেন জাতির বিবেককে জাগিয়ে তোলা, জাগিয়ে রাখার জন্য। জাত তুলে গাল পাড়তে আমাদের জুড়ি নেই—বাঙালি আলসে, তোষামুদে, দুর্নীতিবাজ, ভিতু, পরশ্রীকাতর, ফাঁকিবাজ, মিথ্যাবাদী ইত্যাদি ইত্যাদি। সাধারণ খেটে খাওয়া মানুষ উৎপাদনের জন্য, উপার্জনের জন্য দেশ-বিদেশে যা করছে, তা জেনেও তাদের আলসে বলে ফাঁকিবাজ বলে গাল দেওয়া শুধু তাকেই সাজে, যে নিজে আলসে ও ফাঁকিবাজ। আর জিন্নাহর মুখের ওপর যাঁরা কিনা না বলেছেন, লাঠি-সড়কি নিয়ে যাঁরা অত্যাধুনিক আগ্নেয়াস্ত্রে সজ্জিত পাকিস্তানি হানাদারদের বিরুদ্ধে লড়েছেন, তাঁদের তোষামুদে আর ভীতু বলা তারই সাজে যে তোষামুদে ও ভীতুর দলেই শুধু বিচরণ করে।<br />আছে অবশ্যই আলসেমি, পরশ্রীকাতরতা, তোষামুদি, দুর্নীতি, ফাঁকিবাজি, মিথ্যাচার ইত্যাদি। সব দেশে সব সমাজে কমবেশি আছে, তবে এসব ক্ষতিকর পর্যায়ে পৌঁছেছে কেবল শহুরে শিক্ষিত সমাজে। প্রাতঃস্মরণীয় বিদ্যাসাগর, রবীন্দ্রনাথ, বঙ্কিমচন্দ্র, বেগম রোকেয়া, নজরুল এবং আরও অসংখ্য বাঙালি চিন্তাবিদ যাঁদের কষাঘাত করেছেন, যাঁদের সম্পর্কে সমালোচনামুখর হয়েছেন তাঁরা এই শ্রেণীর মানুষ। এঁরাই সংবাদপত্রের পাঠক ও পৃষ্ঠপোষক বটে, কিন্তু জনগণের ক্ষুদ্র একটি অংশ। এঁরাই যে সমাজের প্রভাবশালী তার কারণ ক্ষমতা ও গণমাধ্যম তাঁদেরই হাতে, তাঁদের ভাবনার প্রতিফলন ঘটে এতে। সেটা, বলা বাহুল্য, দেশের আম-জনগণের ভাবনা বা মতামত নয়।</span></td>\r\n<td><object height="300" width="400"><param name="movie" value="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/14/demo33.flv" /><embed src="http://localhost/moodle/pluginfile.php/40/mod_lesson/page_contents/14/demo33.flv" height="300" width="400" /> </object></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356936064),
(563, 'e9c90912275abb6e83749b15e0699312', '<table style="width: 848px; height: 224px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style="font-size: medium;">বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে? সংবাদপত্র মুখ্যত দৈনন্দিন ঘটনার খবর ছাপে—যেগুলো জনসমক্ষে ঘটে আর যে চাপা খবরগুলো ফাঁস হয় সেগুলো। হাসির চেয়ে কান্নার, জন্মের চেয়ে মৃত্যুর অভিঘাত যেমন প্রবল, তেমনি পাঠককে নাড়া দেওয়ার ক্ষমতা বেশি দুঃসংবাদেরই। মানুষের বিবেককে তার শ্রেষ্ঠ সম্পদ ভাবা হয়। সেই বিবেক সম্পদে-আনন্দে তেমন সাড়া দেয় না, জাগ্রত হয় মানুষের সংকটে-বিপদে।</span><br /><span style="font-size: medium;">একসময় ঢাকাকে বলা হতো মসজিদের নগর, এখন বলা যাবে গণমাধ্যমের নগর। শুনেছি, ছোট-বড় ২০০ বা তার বেশি পত্রিকার ডিক্লারেশন আছে, বেসরকারি চ্যানেলের সংখ্যা কুড়িতে পৌঁছেছে। না, পৃথিবীর ধনী দেশ যাদের নাগরিকদের পরার ও কেনার ক্ষমতা আমাদের চেয়ে অনেক বেশি, তাদের কোথাও গণমাধ্যমের এ রকম বান ডাকেনি। সেসব দেশে এলাকাভিত্তিক ছোট ছোট অসংখ্য কাগজ আছে, যারা নিজ এলাকার ঘটনাগুলো ছাপে—তাতে সুসংবাদই থাকে বেশি। জাতীয় দৈনিক হওয়ার অভিলাষ ও ক্ষমতা তাদের সবার থাকে না—সেটি যেখান থেকেই প্রকাশিত হোক।</span></p>\r\n<p><span style="font-size: medium;">কিন্তু আমাদের এখানে কেউই নিজ এলাকায় সেবা দিয়ে সন্তুষ্ট হন না, সবাই ‘জাতীয় দায়িত্ব’ পালন করতে চান। বিন্দুতেই যে সিন্ধু হয়, সে বিশ্বাস আমাদের নেই। সবাই যেন প্রতিযোগিতায় নেমেছেন জাতির বিবেককে জাগিয়ে তোলা, জাগিয়ে রাখার জন্য। জাত তুলে গাল পাড়তে আমাদের জুড়ি নেই—বাঙালি আলসে, তোষামুদে, দুর্নীতিবাজ, ভিতু, পরশ্রীকাতর, ফাঁকিবাজ, মিথ্যাবাদী ইত্যাদি ইত্যাদি। সাধারণ খেটে খাওয়া মানুষ উৎপাদনের জন্য, উপার্জনের জন্য দেশ-বিদেশে যা করছে, তা জেনেও তাদের আলসে বলে ফাঁকিবাজ বলে গাল দেওয়া শুধু তাকেই সাজে, যে নিজে আলসে ও ফাঁকিবাজ। আর জিন্নাহর মুখের ওপর যাঁরা কিনা না বলেছেন, লাঠি-সড়কি নিয়ে যাঁরা অত্যাধুনিক আগ্নেয়াস্ত্রে সজ্জিত পাকিস্তানি হানাদারদের বিরুদ্ধে লড়েছেন, তাঁদের তোষামুদে আর ভীতু বলা তারই সাজে যে তোষামুদে ও ভীতুর দলেই শুধু বিচরণ করে।</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">\r\n<p align="center"></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356931751),
(564, '46b0559e32cbb2b69850625ff786145e', '<table style="width: 823px; height: 22px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><span style="font-size: medium;">বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে? সংবাদপত্র মুখ্যত দৈনন্দিন ঘটনার খবর ছাপে—যেগুলো জনসমক্ষে ঘটে আর যে চাপা খবরগুলো ফাঁস হয় সেগুলো। হাসির চেয়ে কান্নার, জন্মের চেয়ে মৃত্যুর অভিঘাত যেমন প্রবল, তেমনি পাঠককে নাড়া দেওয়ার ক্ষমতা বেশি দুঃসংবাদেরই। মানুষের বিবেককে তার শ্রেষ্ঠ সম্পদ ভাবা হয়। সেই বিবেক সম্পদে-আনন্দে তেমন সাড়া দেয় না, জাগ্রত হয় মানুষের সংকটে-বিপদে।</span><br /><span style="font-size: medium;">একসময় ঢাকাকে বলা হতো মসজিদের নগর, এখন বলা যাবে গণমাধ্যমের নগর। শুনেছি, ছোট-বড় ২০০ বা তার বেশি পত্রিকার ডিক্লারেশন আছে, বেসরকারি চ্যানেলের সংখ্যা কুড়িতে পৌঁছেছে। না, পৃথিবীর ধনী দেশ যাদের নাগরিকদের পরার ও কেনার ক্ষমতা আমাদের চেয়ে অনেক বেশি, তাদের কোথাও গণমাধ্যমের এ রকম বান ডাকেনি। সেসব দেশে এলাকাভিত্তিক ছোট ছোট অসংখ্য কাগজ আছে, যারা নিজ এলাকার ঘটনাগুলো ছাপে—তাতে সুসংবাদই থাকে বেশি। জাতীয় দৈনিক হওয়ার অভিলাষ ও ক্ষমতা তাদের সবার থাকে না—সেটি যেখান থেকেই প্রকাশিত হোক।</span></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356931757),
