(567, '050d37177262f73d8d1e1d68cca6ab3b', '<table style="width: 348px; height: 22px;" align="center" border="0">\r\n<tbody>\r\n<tr>\r\n<td><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/png;base64," _mce_src="data:image/png;base64," height="261" width="422" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1356931767);
INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(568, '60fa6cd94e516331f073280de0f0edf4', '<p>The assignment activity module enables a teacher to communicate tasks, collect work and provide grades and feedback.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents, spreadsheets, images, or audio and video clips. Alternatively, or in addition, the assignment may require students to type text directly into the text editor. An assignment can also be used to remind students of ''real-world'' assignments they need to complete offline, such as art work, and thus not require any digital content.</p>\n\n<p>When reviewing assignments, teachers can leave feedback comments and upload files, such as marked-up student submissions, documents with comments or spoken audio feedback. Assignments can be graded using a numerical or custom scale or an advanced grading method such as a rubric. Final grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/assignment/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(569, 'f516851a13ce2c6ff63c15e85b3db39f', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(570, 'ef21cf8c3aace5e7d7ac2ee6bdc52cc6', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(571, '49add7af4150bc4f897fc2bab88a7373', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(572, 'f899f8b44e539f2dc83149dfdbd3eb88', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(573, '6d80a9b5228dae2f8869344e46af7eef', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(574, 'd7baeea9a28b27924b3621366181c498', '<p>SCORM এবং AICC হল ওয়েবভিত্তিক শিক্ষনীয় বিষয়বস্তুতে তথ্য আদান-প্রদান, প্রবেশ্যতা এবং পুনরায় ব্যবহারযোগ্যতা সক্রিয় করার সুনির্দিষ্ট সমাহার। SCORM/AICC মডিউল SCORM/AICC কোর্সে যোগ করার অনুমোদন দেয়।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(575, '614b09c7d16a93915a3707f0e05168cc', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(576, '7718ea85df1cca344fbfe3569e023363', '<p>কথোপকথন মডিউলটি অংশগ্রহণকারীকে ওয়েবের মাধ্যমে প্রকৃত সময় যুগপৎ আলোচনার অনুমোদন দেয়। প্রত্যেকের ভিন্ন সমঝোতা পাওয়ার জন্যএটি একটি কার্যকর পদ্ধতি এবং বিষয়টি আলোচনা করা হয়েছে - মোডটি\nকথোপকথন রুম ব্যবহার এসিনক্রোনাস আলোচনাচক্র হতে একেবারেই ভিন্ন।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/chat/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(577, '20887e0dcfdf4d006119ad267a761206', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(578, '69f3f8c884994bd2ae32200ea6be953a', '<p>জরিপের মডিউলটি অনলাইন পরিবেশে শিক্ষা গ্রহণ নির্ধারণ এবং উদ্দীপনের জন্য তিন ধরনের জরিপ যন্ত্র প্রদান করে। ডাটা সংগ্রহের জন্য শিক্ষক এটি ব্যবহার করতে পারবে যা কিনা তাদেরকে ক্লাস সম্পর্কে শিখতে সহায়তা করবে এবং তাদের নিজস্ব পড়ানোকে প্রতিফলিত করবে।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(579, '26379ff7b9623cd45d4aa137692569c7', '<p>The database activity module enables participants to create, maintain and search a bank of record entries. The format and structure of these entries can be almost unlimited, including images, files, URLs, numbers and text amongst other things.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/data/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(580, 'b497fdf91bb21c4def7fcc5a73445ea0', '<p>পছন্দ মডিউল শিক্ষককে প্রশ্ন জিজ্ঞাসা সক্রিয় করে এবং একাধিক উত্তরের পছন্দ সুনির্দিষ্টভাবে উল্লেখ করে</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/choice/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(581, '5cfd0cf9c44fa4dc8597dad59974cd71', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933096),
(582, 'b0fb540fb9ad983be3995f64c68ad72a', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933097),
(583, '69ee515429f754d75ea9b86bd6681294', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933097),
(584, '5a899dad8e7c9852e5e66d1c7e3a6739', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933097),
(585, '0998fcc2c03018f8d9f515ab215e287c', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933097),
(586, 'b56cac4703e8db2fa70de9fe811c0f7b', '<p>বই একটি সাধারণ অনেকগুলো পৃষ্ঠার পড়ার সমাগ্রী।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933097),
(587, '1878f9fa88d9a0cd377fbf8d928cf10e', '<p>কোর্স পৃষ্ঠায় যে যে লিংকে কাজ করা হয় সেখানে এই লেবেল ব্যবহার করে লেখা ও চিত্র দেয়া যায়।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356899222/docs" />আরও সহায়তা</a></div>\n', 1356933097),
(588, '3bf0625a3e227bc9dac0caa6195c38a1', '<div class="no-overflow"><div><span style="font-size: small;"><span style="font-size: small;"><em></em></span></span><em><em><span style="font-size: small;"></span></em></em>\r\n<div class="summary">\r\n<div class="no-overflow">\r\n<p><span style="font-size: medium;">আমরা এই কোর্সে যে যে বিষয় সম্পর্কে জ্ঞান লাভ করব তা হলোঃ বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে? সংবাদপত্র মুখ্যত দৈনন্দিন ঘটনার খবর ছাপে—যেগুলো জনসমক্ষে ঘটে আর যে চাপা খবরগুলো ফাঁস হয় সেগুলো। হাসির চেয়ে কান্নার, জন্মের চেয়ে মৃত্যুর অভিঘাত যেমন প্রবল, তেমনি পাঠককে নাড়া দেওয়ার ক্ষমতা বেশি দুঃসংবাদেরই। মানুষের বিবেককে তার শ্রেষ্ঠ সম্পদ ভাবা হয়। সেই বিবেক সম্পদে-আনন্দে তেমন সাড়া দেয় না, জাগ্রত হয় মানুষের সংকটে-বিপদে।<br />একসময় ঢাকাকে বলা হতো মসজিদের নগর, এখন বলা যাবে গণমাধ্যমের নগর। শুনেছি, ছোট-বড় ২০০ বা তার বেশি পত্রিকার ডিক্লারেশন আছে, বেসরকারি চ্যানেলের সংখ্যা কুড়িতে পৌঁছেছে। না, পৃথিবীর ধনী দেশ যাদের নাগরিকদের পরার ও কেনার ক্ষমতা আমাদের চেয়ে অনেক বেশি, তাদের কোথাও গণমাধ্যমের এ রকম বান ডাকেনি। সেসব দেশে এলাকাভিত্তিক ছোট ছোট অসংখ্য কাগজ আছে, যারা নিজ এলাকার ঘটনাগুলো ছাপে—তাতে সুসংবাদই থাকে বেশি। জাতীয় দৈনিক হওয়ার অভিলাষ ও ক্ষমতা তাদের সবার থাকে না—সেটি যেখান থেকেই প্রকাশিত হোক।</span><span style="font-size: medium; font-family: verdana,arial,helvetica,sans-serif; color: #000000;"></span><em><span style="font-size: small;"><br /></span></em></p>\r\n</div>\r\n</div>\r\n</div></div>', 1356934030),
(589, '11e1150133ffc6fb9f9e107f5a2791a2', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1356933076),
(590, '101f82cd7e6af6fd1209e2e7e0900ffe', '<p>The assignment activity module enables a teacher to communicate tasks, collect work and provide grades and feedback.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents, spreadsheets, images, or audio and video clips. Alternatively, or in addition, the assignment may require students to type text directly into the text editor. An assignment can also be used to remind students of ''real-world'' assignments they need to complete offline, such as art work, and thus not require any digital content.</p>\n\n<p>When reviewing assignments, teachers can leave feedback comments and upload files, such as marked-up student submissions, documents with comments or spoken audio feedback. Assignments can be graded using a numerical or custom scale or an advanced grading method such as a rubric. Final grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/assignment/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(591, 'bcef55d60bc08b32d69ed5bb539ab492', '<p>The chat activity module enables participants to have text-based, real-time synchronous discussions.</p>\n\n<p>The chat may be a one-time activity or it may be repeated at the same time each day or each week. Chat sessions are saved and can be made available for everyone to view or restricted to users with the capability to view chat session logs.</p>\n\n<p>Chats are especially useful when the group chatting is not able to meet face-to-face, such as</p>\n\n<ul><li>Regular meetings of students participating in online courses to enable them to share experiences with others in the same course but in a different location</li>\n<li>A student temporarily unable to attend in person chatting with their teacher to catch up with work</li>\n<li>Students out on work experience getting together to discuss their experiences with each other and their teacher</li>\n<li>Younger children using chat at home in the evenings as a controlled (monitored) introduction to the world of social networking</li>\n<li>A question and answer session with an invited speaker in a different location</li>\n<li>Sessions to help students prepare for tests where the teacher, or other students, would pose sample questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/chat/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(592, 'b71a1918746ba48b83728190428a2e0e', '<p>The choice activity module enables a teacher to ask a single question and offer a selection of possible responses.</p>\n\n<p>Choice results may be published after students have answered, after a certain date, or not at all. Results may be published with student names or anonymously.</p>\n\n<p>A choice activity may be used</p>\n\n<ul><li>As a quick poll to stimulate thinking about a topic</li>\n<li>To quickly test students'' understanding</li>\n<li>To facilitate student decision-making, for example allowing students to vote on a direction for the course</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/choice/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(593, 'b5bc1edf5d82e05adac60811939ccf49', '<p>The database activity module enables participants to create, maintain and search a collection of entries (i.e. records).  The structure of the entries is defined by the teacher as a number of fields. Field types include checkbox, radio buttons, dropdown menu, text area, URL, picture and uploaded file.</p>\n\n<p>The visual layout of information when listing, viewing or editing database entries may be controlled by database templates. Database activities may be shared between courses as presets and a teacher may also import and export database entries.</p>\n\n<p>If the database auto-linking filter is enabled, any entries in a database will be automatically linked where the words or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Database activities have many uses, such as</p>\n\n<ul><li>A collaborative collection of web links, books, book reviews, journal references etc</li>\n<li>For displaying student-created photos, posters, websites or poems for peer comment and review</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/data/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(594, '92ebf06ee831e9576724b2a0bcf59d66', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(595, 'b492bf2edc5d23d6d3c56fd1e7a2b2cc', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(596, '3ca949cf953adfe6bb208415eee28b90', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(597, 'fce0bd145c0ed8f20eb92a7ea954373b', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(598, '4459790844fa6b8d80c32b5ee70b2d17', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(599, '0427f102b870350e159493601b4599e5', '<p>A SCORM package is a collection of files which are packaged according to an agreed standard for learning objects. The SCORM activity module enables SCORM or AICC packages to be uploaded as a zip file and added to a course.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a table of contents, with navigation buttons etc. SCORM activities generally include questions, with grades being recorded in the gradebook.</p>\n\n<p>SCORM activities may be used</p>\n\n<ul><li>For presenting multimedia content and animations</li>\n<li>As an assessment tool</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(600, '2f139bf03875cbb6eca6536814e9b71f', '<p>The survey activity module provides a number of verified survey instruments that have been found useful in assessing and stimulating learning in online environments. A teacher can use these to gather data from their students that will help them learn about their class and reflect on their own teaching.</p>\n\n<p>Note that these survey tools are pre-populated with questions. Teachers who wish to create their own survey should use the feedback activity module.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(601, '32462de6c4d5c93101092bf38875bb29', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(602, '5abcf87c80cc8c031e75a3333b033547', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(603, '21d9700afc44c9e53eacde1f94ef9571', '<p>The book module enables a teacher to create a multi-page resource in a book-like format, with chapters and subchapters. Books can contain media files as well as text and are useful for displaying lengthy passages of information which can be broken down into sections.</p>\n\n<p>A book may be used</p>\n\n<ul><li>To display reading material for individual modules of study</li>\n<li>As a staff departmental handbook</li>\n<li>As a showcase portfolio of student work</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(604, '9bd26fb1df3cefefba5324d3086eafa0', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(605, '9105caad72aba5eed9b9f95e4f0eefb4', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(606, 'f4482ede203499df9abd8a1e1d20672a', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933716),
(607, 'eee220019f33e3c0ae25b26ef8761350', '<p>The label module enables text and multimedia to be inserted into the course page in between links to other resources and activities. Labels are very versatile and can help to improve the appearance of a course if used thoughtfully.</p>\n\n<p>Labels may be used</p>\n\n<ul><li>To split up a long list of activities with a subheading or an image</li>\n<li>To display an embedded sound file or video directly on the course page</li>\n<li>To add a short description to a course section</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933717),
(608, '551495175bad8b3b610ca4cd0cd742c4', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933717),
(609, 'ca2898e937d86041e12ba83306c500c3', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />More help</a></div>\n', 1356933717);
INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(610, 'b22bb8426aff5ffc404a856a6f0f83f6', '<p>The assignment activity module enables a teacher to communicate tasks, collect work and provide grades and feedback.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents, spreadsheets, images, or audio and video clips. Alternatively, or in addition, the assignment may require students to type text directly into the text editor. An assignment can also be used to remind students of ''real-world'' assignments they need to complete offline, such as art work, and thus not require any digital content.</p>\n\n<p>When reviewing assignments, teachers can leave feedback comments and upload files, such as marked-up student submissions, documents with comments or spoken audio feedback. Assignments can be graded using a numerical or custom scale or an advanced grading method such as a rubric. Final grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/assignment/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(611, 'f6c2f47e45922fc0eb1780456a82220a', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(612, '394dec6e3a34370a4b207c4da799de8c', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(613, '474835976f11e0df6be972f0eccfc573', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(614, 'b76d9b30c2f45e361d382e3624157a61', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(615, '0caf4d7ba16ef02bcccde15a6c995387', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(616, '0515d79e2b5c0ce443b4c1ebc62e78ef', '<p>SCORM এবং AICC হল ওয়েবভিত্তিক শিক্ষনীয় বিষয়বস্তুতে তথ্য আদান-প্রদান, প্রবেশ্যতা এবং পুনরায় ব্যবহারযোগ্যতা সক্রিয় করার সুনির্দিষ্ট সমাহার। SCORM/AICC মডিউল SCORM/AICC কোর্সে যোগ করার অনুমোদন দেয়।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(617, 'a3ff441eb2d4b6d893ff18357c27526e', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(618, 'c5ba9278040089bf6d9192c12ca66c52', '<p>কথোপকথন মডিউলটি অংশগ্রহণকারীকে ওয়েবের মাধ্যমে প্রকৃত সময় যুগপৎ আলোচনার অনুমোদন দেয়। প্রত্যেকের ভিন্ন সমঝোতা পাওয়ার জন্যএটি একটি কার্যকর পদ্ধতি এবং বিষয়টি আলোচনা করা হয়েছে - মোডটি\nকথোপকথন রুম ব্যবহার এসিনক্রোনাস আলোচনাচক্র হতে একেবারেই ভিন্ন।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/chat/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(619, 'c82e73be2d990f2dbb641e7192eaf705', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(620, '1e4e37cc8231146e609669c90ccbb7a6', '<p>জরিপের মডিউলটি অনলাইন পরিবেশে শিক্ষা গ্রহণ নির্ধারণ এবং উদ্দীপনের জন্য তিন ধরনের জরিপ যন্ত্র প্রদান করে। ডাটা সংগ্রহের জন্য শিক্ষক এটি ব্যবহার করতে পারবে যা কিনা তাদেরকে ক্লাস সম্পর্কে শিখতে সহায়তা করবে এবং তাদের নিজস্ব পড়ানোকে প্রতিফলিত করবে।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(621, '9ba8edb30a7c8d4cb23dcab35c3b00cc', '<p>The database activity module enables participants to create, maintain and search a bank of record entries. The format and structure of these entries can be almost unlimited, including images, files, URLs, numbers and text amongst other things.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/data/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(622, '3665ab557c501eaff49843884fcb5bde', '<p>পছন্দ মডিউল শিক্ষককে প্রশ্ন জিজ্ঞাসা সক্রিয় করে এবং একাধিক উত্তরের পছন্দ সুনির্দিষ্টভাবে উল্লেখ করে</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/choice/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(623, 'd117586ae36fabc5bab86a1c521371ec', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(624, 'a8b447a264cd04c51d190eda39ba3ce3', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(625, '4419ef3cb158ac32fb227b3ffb19c1d8', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(626, '65c4cda8c685c3075f2d041ebd5d3c8e', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(627, '52a660d5a2bd0e925394b5aacfa9b2fc', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(628, 'be4abd6068e7517b008d17fe7c825647', '<p>বই একটি সাধারণ অনেকগুলো পৃষ্ঠার পড়ার সমাগ্রী।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(629, 'd5c8d9feadf6c8bd699dc36b628959f2', '<p>কোর্স পৃষ্ঠায় যে যে লিংকে কাজ করা হয় সেখানে এই লেবেল ব্যবহার করে লেখা ও চিত্র দেয়া যায়।</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/bn/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="আরও সহায়তা" title="আরও সহায়তা" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933272/docs" />আরও সহায়তা</a></div>\n', 1356933728),
(630, 'a37551f5676358dd230914b44bdc7135', '<p>The assignment activity module enables a teacher to communicate tasks, collect work and provide grades and feedback.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents, spreadsheets, images, or audio and video clips. Alternatively, or in addition, the assignment may require students to type text directly into the text editor. An assignment can also be used to remind students of ''real-world'' assignments they need to complete offline, such as art work, and thus not require any digital content.</p>\n\n<p>When reviewing assignments, teachers can leave feedback comments and upload files, such as marked-up student submissions, documents with comments or spoken audio feedback. Assignments can be graded using a numerical or custom scale or an advanced grading method such as a rubric. Final grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/assignment/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934014),
(631, '06d7e95fa01e7df601a256303dd47f48', '<p>The chat activity module enables participants to have text-based, real-time synchronous discussions.</p>\n\n<p>The chat may be a one-time activity or it may be repeated at the same time each day or each week. Chat sessions are saved and can be made available for everyone to view or restricted to users with the capability to view chat session logs.</p>\n\n<p>Chats are especially useful when the group chatting is not able to meet face-to-face, such as</p>\n\n<ul><li>Regular meetings of students participating in online courses to enable them to share experiences with others in the same course but in a different location</li>\n<li>A student temporarily unable to attend in person chatting with their teacher to catch up with work</li>\n<li>Students out on work experience getting together to discuss their experiences with each other and their teacher</li>\n<li>Younger children using chat at home in the evenings as a controlled (monitored) introduction to the world of social networking</li>\n<li>A question and answer session with an invited speaker in a different location</li>\n<li>Sessions to help students prepare for tests where the teacher, or other students, would pose sample questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/chat/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(632, 'aa416b7fa86fce4aabf9c701b369e009', '<p>The choice activity module enables a teacher to ask a single question and offer a selection of possible responses.</p>\n\n<p>Choice results may be published after students have answered, after a certain date, or not at all. Results may be published with student names or anonymously.</p>\n\n<p>A choice activity may be used</p>\n\n<ul><li>As a quick poll to stimulate thinking about a topic</li>\n<li>To quickly test students'' understanding</li>\n<li>To facilitate student decision-making, for example allowing students to vote on a direction for the course</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/choice/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(633, 'eb52a5e2ebec4fd0c0d90434b09db7ab', '<p>The database activity module enables participants to create, maintain and search a collection of entries (i.e. records).  The structure of the entries is defined by the teacher as a number of fields. Field types include checkbox, radio buttons, dropdown menu, text area, URL, picture and uploaded file.</p>\n\n<p>The visual layout of information when listing, viewing or editing database entries may be controlled by database templates. Database activities may be shared between courses as presets and a teacher may also import and export database entries.</p>\n\n<p>If the database auto-linking filter is enabled, any entries in a database will be automatically linked where the words or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Database activities have many uses, such as</p>\n\n<ul><li>A collaborative collection of web links, books, book reviews, journal references etc</li>\n<li>For displaying student-created photos, posters, websites or poems for peer comment and review</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/data/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(634, '8257a3429545a71340c8037e2edefc55', '<p>The external tool activity module enables students to interact with learning resources and activities on other web sites. For example, an external tool could provide access to a new activity type or learning materials from a publisher.</p>\n\n<p>To create an external tool activity, a tool provider which supports LTI (Learning Tools Interoperability) is required. A teacher can create an external tool activity or make use of a tool configured by the site administrator.</p>\n\n<p>External tool activities differ from URL resources in a few ways:</p>\n\n<ul><li>External tools are context aware i.e. they have access to information about the user who launched the tool, such as institution, course and name</li>\n<li>External tools support reading, updating, and deleting grades associated with the activity instance</li>\n<li>External tool configurations create a trust relationship between your site and the tool provider, allowing secure communication between them</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lti/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(635, '8b87f70a1e8891e8de610fa12f4e3cb3', '<p>The forum activity module enables participants to have asynchronous discussions i.e. discussions that take place over an extended period of time.</p>\n\n<p>There are several forum types to choose from, such as a standard forum where anyone can start a new discussion at any time; a forum where each student can post exactly one discussion; or a question and answer forum where students must first post before being able to view other students'' posts. A teacher can allow files to be attached to forum posts. Attached images are displayed in the forum post.</p>\n\n<p>Participants can subscribe to a forum to receive notifications of new forum posts. A teacher can set the subscription mode to optional, forced or auto, or prevent subscription completely. If required, students can be blocked from posting more than a given number of posts in a given time period; this can prevent individuals from dominating discussions.</p>\n\n<p>Forum posts can be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Forums have many uses, such as</p>\n\n<ul><li>A social space for students to get to know each other</li>\n<li>For course announcements (using a news forum with forced subscription)</li>\n<li>For discussing course content or reading materials</li>\n<li>For continuing online an issue raised previously in a face-to-face session</li>\n<li>For teacher-only discussions (using a hidden forum)</li>\n<li>A help centre where tutors and students can give advice</li>\n<li>A one-on-one support area for private student-teacher communications (using a forum with separate groups and with one student per group)</li>\n<li>For extension activities, for example ‘brain teasers’ for students to ponder and suggest solutions to</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/forum/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(636, '7c2a00ddcb240736fa3328be4b986995', '<p>The glossary activity module enables participants to create and maintain a list of definitions, like a dictionary, or to collect and organise resources or information.</p>\n\n<p>A teacher can allow files to be attached to glossary entries. Attached images are displayed in the entry. Entries can be searched or browsed alphabetically or by category, date or author. Entries can be approved by default or require approval by a teacher before they are viewable by everyone.</p>\n\n<p>If the glossary auto-linking filter is enabled, entries will be automatically linked where the concept words and/or phrases appear within the course.</p>\n\n<p>A teacher can allow comments on entries. Entries can also be rated by teachers or students (peer evaluation). Ratings can be aggregated to form a final grade which is recorded in the gradebook.</p>\n\n<p>Glossaries have many uses, such as</p>\n\n<ul><li>A collaborative bank of key terms</li>\n<li>A ‘getting to know you’ space where new students add their name and personal details</li>\n<li>A ‘handy tips’ resource of best practice in a practical subject</li>\n<li>A sharing area of useful videos, images or sound files</li>\n<li>A revision resource of facts to remember</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/glossary/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(637, 'c77eac35308ef9132c1d57733e6b9a53', '<p>The lesson activity module enables a teacher to deliver content and/or practice activities in  interesting and flexible ways. A teacher can use the lesson to create a linear set of content pages or instructional activities that offer a variety of paths or options for the learner. In either case, teachers can choose to increase engagement and ensure understanding by including a variety of questions, such as multiple choice, matching and short answer. Depending on the student''s choice of answer and how the teacher develops the lesson, students may progress to the next page, be taken back to a previous page or redirected down a different path entirely.</p>\n\n<p>A lesson may be graded, with the grade recorded in the gradebook.</p>\n\n<p>Lessons may be used</p>\n\n<ul><li>For self-directed learning of a new topic</li>\n<li>For  scenarios or simulations/decision-making exercises</li>\n<li>For differentiated revision, with different sets of revision questions depending upon answers given to initial questions</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/lesson/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(638, 'f9b1e617aa62bc177c07d7957172f0d8', '<p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\n\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\n\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\n\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\n\n<p>Quizzes may be used</p>\n\n<ul><li>As course exams</li>\n<li>As mini tests for reading assignments or at the end of a topic</li>\n<li>As exam practice using questions from past exams</li>\n<li>To deliver immediate feedback about performance</li>\n<li>For self-assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/quiz/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(639, 'ab0c5bf0abdeecb739a95b9ae43169a4', '<p>A SCORM package is a collection of files which are packaged according to an agreed standard for learning objects. The SCORM activity module enables SCORM or AICC packages to be uploaded as a zip file and added to a course.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a table of contents, with navigation buttons etc. SCORM activities generally include questions, with grades being recorded in the gradebook.</p>\n\n<p>SCORM activities may be used</p>\n\n<ul><li>For presenting multimedia content and animations</li>\n<li>As an assessment tool</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/scorm/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(640, 'fa0c2db66ae32b17a2f7836d1f3f91a0', '<p>The survey activity module provides a number of verified survey instruments that have been found useful in assessing and stimulating learning in online environments. A teacher can use these to gather data from their students that will help them learn about their class and reflect on their own teaching.</p>\n\n<p>Note that these survey tools are pre-populated with questions. Teachers who wish to create their own survey should use the feedback activity module.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/survey/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(641, 'b76b3b45721d760735d071962287d0d1', '<p>The wiki activity module enables participants to add and edit a collection of web pages. A wiki can be collaborative, with everyone being able to edit it, or individual, where everyone has their own wiki which only they can edit.</p>\n\n<p>A history of previous versions of each page in the wiki is kept, listing the edits made by each participant.</p>\n\n<p>Wikis have many uses, such as</p>\n\n<ul><li>For group lecture notes or study guides</li>\n<li>For members of a faculty to plan a scheme of work or meeting agenda together</li>\n<li>For students to collaboratively author an online book, creating content on a topic set by their tutor</li>\n<li>For collaborative storytelling or poetry creation, where each participant writes a line or verse</li>\n<li>As a personal journal for examination notes or revision (using an individual wiki)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/wiki/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(642, 'b9755c3abfece0df0215aa14fe499109', '<p>The workshop activity module enables the collection, review and peer assessment of students'' work.</p>\n\n<p>Students can submit any digital content (files), such as word-processed documents or spreadsheets and can also type text directly into a field using the text editor.</p>\n\n<p>Submissions are assessed using a multi-criteria assessment form defined by the teacher. The process of peer assessment and understanding the assessment form can be practised in advance with example submissions provided by the teacher, together with a reference assessment. Students are given the opportunity to assess one or more of their peers'' submissions. Submissions and reviewers may be anonymous if required.</p>\n\n<p>Students obtain two grades in a workshop activity - a grade for their submission and a grade for their assessment of their peers'' submissions. Both grades are recorded in the gradebook.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/workshop/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(643, '3a110e9e7c9e1584a9d4890b96184306', '<p>The book module enables a teacher to create a multi-page resource in a book-like format, with chapters and subchapters. Books can contain media files as well as text and are useful for displaying lengthy passages of information which can be broken down into sections.</p>\n\n<p>A book may be used</p>\n\n<ul><li>To display reading material for individual modules of study</li>\n<li>As a staff departmental handbook</li>\n<li>As a showcase portfolio of student work</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/book/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(644, '6f5976792c95ebc6bab88a62b1a17a9d', '<p>The file module enables a teacher to provide a file as a course resource. Where possible, the file will be displayed within the course interface; otherwise students will be prompted to download it. The file may include supporting files, for example an HTML page may have embedded images or Flash objects.</p>\n\n<p>Note that students need to have the appropriate software on their computers in order to open the file.</p>\n\n<p>A file may be used</p>\n\n<ul><li>To share presentations given in class</li>\n<li>To include a mini website as a course resource</li>\n<li>To provide draft files of certain software programs (eg Photoshop .psd) so students can edit and submit them for assessment</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/resource/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(645, '55120a4fefcf99549f7adf1f16a9d09c', '<p>The folder module enables a teacher to display a number of related files inside a single folder, reducing scrolling on the course page. A zipped folder may be uploaded and unzipped for display, or an empty folder created and files uploaded into it.</p>\n\n<p>A folder may be used</p>\n\n<ul><li>For a series of files on one topic, for example a set of past examination papers in pdf format or a collection of image files for use in student projects</li>\n<li>To provide a shared uploading space for teachers on the course page (keeping the folder hidden so that only teachers can see it)</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/folder/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(646, '8d7710ee63351527b61eb6e9689b0590', '<p>An IMS content package is a collection of files which are packaged according to an agreed standard so they can be reused in different systems. The IMS content package module enables such content packages to be uploaded as a zip file and added to a course as a resource.</p>\n\n<p>Content is usually displayed over several pages, with navigation between the pages. There are various options for displaying content in a pop-up window, with a navigation menu or buttons etc.</p>\n\n<p>An IMS content package may be used for presenting multimedia content and animations.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/imscp/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(647, '0be71129220eeacc12b2a3344994f4a4', '<p>The label module enables text and multimedia to be inserted into the course page in between links to other resources and activities. Labels are very versatile and can help to improve the appearance of a course if used thoughtfully.</p>\n\n<p>Labels may be used</p>\n\n<ul><li>To split up a long list of activities with a subheading or an image</li>\n<li>To display an embedded sound file or video directly on the course page</li>\n<li>To add a short description to a course section</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/label/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(648, 'abbd31d1e748dd4fddbfab7fd02fa0ef', '<p>The page module enables a teacher to create a web page resource using the text editor. A page can display text, images, sound, video, web links and embedded code, such as Google maps.</p>\n\n<p>Advantages of using the page module rather than the file module include the resource being more accessible (for example to users of mobile devices) and easier to update.</p>\n\n<p>For large amounts of content, it''s recommended that a book is used rather than a page.</p>\n\n<p>A page may be used</p>\n\n<ul><li>To present the terms and conditions of a course or a summary of the course syllabus</li>\n<li>To embed several videos or sound files together with some explanatory text</li>\n</ul><div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/page/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015),
(649, '7550623a82fc7465e35386bb83b27253', '<p>The URL module enables a teacher to provide a web link as a course resource. Anything that is freely available online, such as documents or images, can be linked to; the URL doesn’t have to be the home page of a website. The URL of a particular web page may be copied and pasted or a teacher can use the file picker and choose a link from a repository such as Flickr, YouTube or Wikimedia (depending upon which repositories are enabled for the site).</p>\n\n<p>There are a number of display options for the URL, such as embedded or opening in a new window and advanced options for passing information, such as a student''s name, to the URL if required.</p>\n\n<p>Note that URLs can also be added to any other resource or activity type through the text editor.</p>\n\n<div class="helpdoclink"><a href="http://docs.moodle.org/23/en/mod/url/view" class="helplinkpopup"><img class="iconhelp" alt="More help" title="More help" src="http://localhost/moodle/theme/image.php/afterburner/core/1356933754/docs" />More help</a></div>\n', 1356934015);
