INSERT INTO `mdl_lesson_pages` (`id`, `lessonid`, `prevpageid`, `nextpageid`, `qtype`, `qoption`, `layout`, `display`, `timecreated`, `timemodified`, `title`, `contents`, `contentsformat`) VALUES
(2, 1, 1, 14, 20, 0, 1, 1, 1356871380, 0, 'বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে', '<table style="width: 858px; height: 258px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<div><span style="font-size: small;"><img src="data:image/png;base64," alt="" height="133" width="846" /></span></div>\r\n<div><span style="font-size: small;"> </span></div>\r\n<span style="font-size: medium;">বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে? সংবাদপত্র মুখ্যত দৈনন্দিন ঘটনার খবর ছাপে—যেগুলো জনসমক্ষে ঘটে আর যে চাপা খবরগুলো ফাঁস হয় সেগুলো। হাসির চেয়ে কান্নার, জন্মের চেয়ে মৃত্যুর অভিঘাত যেমন প্রবল, তেমনি পাঠককে নাড়া দেওয়ার ক্ষমতা বেশি দুঃসংবাদেরই। মানুষের বিবেককে তার শ্রেষ্ঠ সম্পদ ভাবা হয়। সেই বিবেক সম্পদে-আনন্দে তেমন সাড়া দেয় না, জাগ্রত হয় মানুষের সংকটে-বিপদে।</span><br /><span style="font-size: medium;">একসময় ঢাকাকে বলা হতো মসজিদের নগর, এখন বলা যাবে গণমাধ্যমের নগর। শুনেছি, ছোট-বড় ২০০ বা তার বেশি পত্রিকার ডিক্লারেশন আছে, বেসরকারি চ্যানেলের সংখ্যা কুড়িতে পৌঁছেছে। না, পৃথিবীর ধনী দেশ যাদের নাগরিকদের পরার ও কেনার ক্ষমতা আমাদের চেয়ে অনেক বেশি, তাদের কোথাও গণমাধ্যমের এ রকম বান ডাকেনি। সেসব দেশে এলাকাভিত্তিক ছোট ছোট অসংখ্য কাগজ আছে, যারা নিজ এলাকার ঘটনাগুলো ছাপে—তাতে সুসংবাদই থাকে বেশি। জাতীয় দৈনিক হওয়ার অভিলাষ ও ক্ষমতা তাদের সবার থাকে না—সেটি যেখান থেকেই প্রকাশিত হোক।</span></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1);
INSERT INTO `mdl_lesson_pages` (`id`, `lessonid`, `prevpageid`, `nextpageid`, `qtype`, `qoption`, `layout`, `display`, `timecreated`, `timemodified`, `title`, `contents`, `contentsformat`) VALUES
(4, 1, 14, 5, 20, 0, 1, 1, 1356872536, 0, 'বাংলাদেশি পোশাকের বিদেশি ক্রেতারা আশুলিয়ায় তাজরীন', '<table style="width: 841px; height: 610px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><img style="display: block; margin-left: auto; margin-right: auto;" src="@@PLUGINFILE@@/SWASHTHA-Logo.jpg" height="327" width="683" /></td>\r\n</tr>\r\n<tr>\r\n<td class="shoulder">\r\n<div class="threeCol pageMiddle widgetDragable white">\r\n<div class="adWidget widget-740">\r\n<div style="display: block;" class="dn commonAdClass adz-pageTop adz-285"></div>\r\n</div>\r\n</div>\r\n<span style="font-size: medium;">বাংলাদেশি পোশাকের বিদেশি ক্রেতারা আশুলিয়ায় তাজরীন ফ্যাশনসে অগ্নিকাণ্ড এবং ১১১ জন শ্রমিকের মৃত্যুকে একধরনের সতর্কসংকেত মনে করছেন। ক্রেতারা কারখানাতে অগ্নিনিরাপত্তার দ্রুত মানোন্নয়ন করার তাগিদ দিয়েছেন। এ ক্ষেত্রে তাঁরা সরকারের কাছে নিরাপত্তা নিশ্চিত করার অঙ্গীকারও চেয়েছেন।</span><br /><span style="font-size: medium;">অগ্নিনিরাপত্তা তৈরিতে করণীয় নির্ধারণের ক্ষেত্রে তৈরি পোশাক মালিক সমিতি বিজিএমইএ টাস্কফোর্স গঠনের সিদ্ধান্ত জানিয়েছে। আর ক্রেতারা এ টাস্কফোর্সে বিদেশি অডিট প্রতিষ্ঠান, আইনজ্ঞ, স্থপতি ও প্রকৌশলীদের সম্পৃক্ত করার প্রস্তাব দিয়েছেন।</span><br /><span style="font-size: medium;">বিজিএমইএর আয়োজনে তৈরি পোশাকের বিদেশি ক্রেতাদের এক বৈঠকে আন্তর্জাতিক খ্যাতনামা সব প্রতিষ্ঠানের প্রতিনিধিরা গতকাল শুক্রবার এসব মতামত দেন। ক্রেতারা সভায় কারখানা চলাকালে ভবনের সব ধরনের দরজা উন্মুক্ত রাখা এবং ভবন নির্মাণবিধি ও অগ্নিনির্বাপণ প্রত্যয়নপত্র নিশ্চিত করতে তাগিদ দিয়েছেন। কোনো কোনো ক্রেতা প্রতিষ্ঠানের প্রতিনিধি দীর্ঘ মেয়াদে টাস্কফোর্সের সুপারিশ ধরে শ্রমিকের মজুরি বা শ্রমমূল্য বাড়ানোর তাগিদ দিয়েছেন।</span><br /><span style="font-size: medium;">অন্যদিকে বিজিএমইএ ক্রেতাদের কাছে পোশাকের মূল্য বাড়ানোর প্রস্তাব করেছে। জবাবে ক্রেতারা বলেছেন, ভালো প্রস্তাব। তবে এটা ক্রেতা-বিক্রেতার নিজেদের মধ্যকার চুক্তির বিষয়।</span></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1),
(5, 1, 4, 6, 20, 0, 1, 1, 1356874927, 0, 'বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে?', '<table style="width: 848px; height: 224px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style="font-size: medium;">বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে? সংবাদপত্র মুখ্যত দৈনন্দিন ঘটনার খবর ছাপে—যেগুলো জনসমক্ষে ঘটে আর যে চাপা খবরগুলো ফাঁস হয় সেগুলো। হাসির চেয়ে কান্নার, জন্মের চেয়ে মৃত্যুর অভিঘাত যেমন প্রবল, তেমনি পাঠককে নাড়া দেওয়ার ক্ষমতা বেশি দুঃসংবাদেরই। মানুষের বিবেককে তার শ্রেষ্ঠ সম্পদ ভাবা হয়। সেই বিবেক সম্পদে-আনন্দে তেমন সাড়া দেয় না, জাগ্রত হয় মানুষের সংকটে-বিপদে।</span><br /><span style="font-size: medium;">একসময় ঢাকাকে বলা হতো মসজিদের নগর, এখন বলা যাবে গণমাধ্যমের নগর। শুনেছি, ছোট-বড় ২০০ বা তার বেশি পত্রিকার ডিক্লারেশন আছে, বেসরকারি চ্যানেলের সংখ্যা কুড়িতে পৌঁছেছে। না, পৃথিবীর ধনী দেশ যাদের নাগরিকদের পরার ও কেনার ক্ষমতা আমাদের চেয়ে অনেক বেশি, তাদের কোথাও গণমাধ্যমের এ রকম বান ডাকেনি। সেসব দেশে এলাকাভিত্তিক ছোট ছোট অসংখ্য কাগজ আছে, যারা নিজ এলাকার ঘটনাগুলো ছাপে—তাতে সুসংবাদই থাকে বেশি। জাতীয় দৈনিক হওয়ার অভিলাষ ও ক্ষমতা তাদের সবার থাকে না—সেটি যেখান থেকেই প্রকাশিত হোক।</span></p>\r\n<p><span style="font-size: medium;">কিন্তু আমাদের এখানে কেউই নিজ এলাকায় সেবা দিয়ে সন্তুষ্ট হন না, সবাই ‘জাতীয় দায়িত্ব’ পালন করতে চান। বিন্দুতেই যে সিন্ধু হয়, সে বিশ্বাস আমাদের নেই। সবাই যেন প্রতিযোগিতায় নেমেছেন জাতির বিবেককে জাগিয়ে তোলা, জাগিয়ে রাখার জন্য। জাত তুলে গাল পাড়তে আমাদের জুড়ি নেই—বাঙালি আলসে, তোষামুদে, দুর্নীতিবাজ, ভিতু, পরশ্রীকাতর, ফাঁকিবাজ, মিথ্যাবাদী ইত্যাদি ইত্যাদি। সাধারণ খেটে খাওয়া মানুষ উৎপাদনের জন্য, উপার্জনের জন্য দেশ-বিদেশে যা করছে, তা জেনেও তাদের আলসে বলে ফাঁকিবাজ বলে গাল দেওয়া শুধু তাকেই সাজে, যে নিজে আলসে ও ফাঁকিবাজ। আর জিন্নাহর মুখের ওপর যাঁরা কিনা না বলেছেন, লাঠি-সড়কি নিয়ে যাঁরা অত্যাধুনিক আগ্নেয়াস্ত্রে সজ্জিত পাকিস্তানি হানাদারদের বিরুদ্ধে লড়েছেন, তাঁদের তোষামুদে আর ভীতু বলা তারই সাজে যে তোষামুদে ও ভীতুর দলেই শুধু বিচরণ করে।</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;">\r\n<p align="center"></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1),
(6, 1, 5, 7, 20, 0, 1, 1, 1356875961, 0, 'আমরা এ মডিউলে যা শিখলাম ', '<table style="width: 823px; height: 22px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><span style="font-size: medium;">বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে ভাবতে হচ্ছে, সংবাদপত্রে কি প্রকৃত বাংলাদেশের খবর মেলে? সংবাদপত্র মুখ্যত দৈনন্দিন ঘটনার খবর ছাপে—যেগুলো জনসমক্ষে ঘটে আর যে চাপা খবরগুলো ফাঁস হয় সেগুলো। হাসির চেয়ে কান্নার, জন্মের চেয়ে মৃত্যুর অভিঘাত যেমন প্রবল, তেমনি পাঠককে নাড়া দেওয়ার ক্ষমতা বেশি দুঃসংবাদেরই। মানুষের বিবেককে তার শ্রেষ্ঠ সম্পদ ভাবা হয়। সেই বিবেক সম্পদে-আনন্দে তেমন সাড়া দেয় না, জাগ্রত হয় মানুষের সংকটে-বিপদে।</span><br /><span style="font-size: medium;">একসময় ঢাকাকে বলা হতো মসজিদের নগর, এখন বলা যাবে গণমাধ্যমের নগর। শুনেছি, ছোট-বড় ২০০ বা তার বেশি পত্রিকার ডিক্লারেশন আছে, বেসরকারি চ্যানেলের সংখ্যা কুড়িতে পৌঁছেছে। না, পৃথিবীর ধনী দেশ যাদের নাগরিকদের পরার ও কেনার ক্ষমতা আমাদের চেয়ে অনেক বেশি, তাদের কোথাও গণমাধ্যমের এ রকম বান ডাকেনি। সেসব দেশে এলাকাভিত্তিক ছোট ছোট অসংখ্য কাগজ আছে, যারা নিজ এলাকার ঘটনাগুলো ছাপে—তাতে সুসংবাদই থাকে বেশি। জাতীয় দৈনিক হওয়ার অভিলাষ ও ক্ষমতা তাদের সবার থাকে না—সেটি যেখান থেকেই প্রকাশিত হোক।</span></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1);
