INSERT INTO `mdl_lesson_pages` (`id`, `lessonid`, `prevpageid`, `nextpageid`, `qtype`, `qoption`, `layout`, `display`, `timecreated`, `timemodified`, `title`, `contents`, `contentsformat`) VALUES
(8, 1, 7, 9, 3, 0, 0, 0, 1356876894, 0, 'Question-1', '<p><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">The<span class="nolink"> <span class="autolink">Water and Sanitation</span></span> Program (WSP) is a multi-donor partnership administered by the</span></p>', 1),
(9, 1, 8, 10, 2, 0, 0, 0, 1356877231, 0, 'Question-2', '<p><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">The <span class="autolink">Water and Sanitation</span> Program (WSP) i</span><span id="yui_3_5_1_1_1356876529901_257" style="font-size: small;">s to support poor people in obtaining affordable, safe and sustainable access to <span class="autolink">water and sanitation</span> services.</span></p>', 1),
(10, 1, 9, 11, 1, 0, 0, 0, 1356877412, 0, 'Question-3', '<p><span id="yui_3_5_1_1_1356877287384_247" style="font-size: small;">Today, how many people live without access to improved sanitation?</span></p>', 1),
(11, 1, 10, 12, 3, 0, 0, 0, 1356877605, 0, 'Question-4', '<p><span id="yui_3_5_1_1_1356877287384_247" style="font-size: small;">How many peoples live in rural communities</span>?</p>', 1),
(12, 1, 11, 13, 3, 0, 0, 0, 1356878255, 0, 'Question-5', '<p><span id="yui_3_5_1_1_1356877804701_247" style="font-weight: normal; font-family: Helvetica,Verdana,Sans-Serif; font-size: small;">______________ remains one of the main threats to child health and well-being in the developing world.</span></p>', 1),
(13, 1, 12, 0, 20, 0, 1, 1, 1356878729, 0, 'End of Lesson', '<table style="width: 389px; height: 22px;" align="center" border="0">\r\n<tbody>\r\n<tr>\r\n<td><img src="data:image/png;base64," alt="" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1),
(14, 1, 2, 4, 20, 0, 1, 1, 1356897446, 0, 'বিজয়ের চার দশক পেরিয়ে বিজয়ের মাসে', '<table style="width: 872px; height: 139px;" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><span style="font-size: small;"></span><span style="font-size: medium;">কিন্তু আমাদের এখানে কেউই নিজ এলাকায় সেবা দিয়ে সন্তুষ্ট হন না, সবাই ‘জাতীয় দায়িত্ব’ পালন করতে চান। বিন্দুতেই যে সিন্ধু হয়, সে বিশ্বাস আমাদের নেই। সবাই যেন প্রতিযোগিতায় নেমেছেন জাতির বিবেককে জাগিয়ে তোলা, জাগিয়ে রাখার জন্য। জাত তুলে গাল পাড়তে আমাদের জুড়ি নেই—বাঙালি আলসে, তোষামুদে, দুর্নীতিবাজ, ভিতু, পরশ্রীকাতর, ফাঁকিবাজ, মিথ্যাবাদী ইত্যাদি ইত্যাদি। সাধারণ খেটে খাওয়া মানুষ উৎপাদনের জন্য, উপার্জনের জন্য দেশ-বিদেশে যা করছে, তা জেনেও তাদের আলসে বলে ফাঁকিবাজ বলে গাল দেওয়া শুধু তাকেই সাজে, যে নিজে আলসে ও ফাঁকিবাজ। আর জিন্নাহর মুখের ওপর যাঁরা কিনা না বলেছেন, লাঠি-সড়কি নিয়ে যাঁরা অত্যাধুনিক আগ্নেয়াস্ত্রে সজ্জিত পাকিস্তানি হানাদারদের বিরুদ্ধে লড়েছেন, তাঁদের তোষামুদে আর ভীতু বলা তারই সাজে যে তোষামুদে ও ভীতুর দলেই শুধু বিচরণ করে।<br />আছে অবশ্যই আলসেমি, পরশ্রীকাতরতা, তোষামুদি, দুর্নীতি, ফাঁকিবাজি, মিথ্যাচার ইত্যাদি। সব দেশে সব সমাজে কমবেশি আছে, তবে এসব ক্ষতিকর পর্যায়ে পৌঁছেছে কেবল শহুরে শিক্ষিত সমাজে। প্রাতঃস্মরণীয় বিদ্যাসাগর, রবীন্দ্রনাথ, বঙ্কিমচন্দ্র, বেগম রোকেয়া, নজরুল এবং আরও অসংখ্য বাঙালি চিন্তাবিদ যাঁদের কষাঘাত করেছেন, যাঁদের সম্পর্কে সমালোচনামুখর হয়েছেন তাঁরা এই শ্রেণীর মানুষ। এঁরাই সংবাদপত্রের পাঠক ও পৃষ্ঠপোষক বটে, কিন্তু জনগণের ক্ষুদ্র একটি অংশ। এঁরাই যে সমাজের প্রভাবশালী তার কারণ ক্ষমতা ও গণমাধ্যম তাঁদেরই হাতে, তাঁদের ভাবনার প্রতিফলন ঘটে এতে। সেটা, বলা বাহুল্য, দেশের আম-জনগণের ভাবনা বা মতামত নয়।</span></td>\r\n<td><object height="300" width="400"><param name="movie" value="@@PLUGINFILE@@/demo33.flv" /><embed src="@@PLUGINFILE@@/demo33.flv" height="300" width="400" /> </object></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1);
