INSERT INTO `mdl_page` (`id`, `course`, `name`, `intro`, `introformat`, `content`, `contentformat`, `legacyfiles`, `legacyfileslast`, `display`, `displayoptions`, `revision`, `timemodified`) VALUES
(1, 2, 'Online learning Course Outline', '<p>Online learning Course Outline....</p>', 1, '<p><strong>SANITATION HACKATHON</strong><br /><br />    Hackathon = hacking marathon<br />    Gathers together sanitation experts with ICT experts to find solutions to world’s biggest challenges of hygienic sanitation.<br />    December, 2012 , Around the world.<br />    In Bangladesh the Sanitation Hackathon will take place at Ruposhi Bangla Hotel in Dhaka on 30th November and 1st December.<br /><br /><strong>Advantages of Sanitation Hackathon</strong><br /><br />    network of non-traditional partners committed to<br />    experts develop new applications and technologies to address sanitation challenges<br />    It promotes the adoption of new applications and appropriate technologies<br />    It helps spreading the culture of open data and sharing of information with partners<br /><br /><strong>What can we do with our IT?</strong><br /><br />    Increasingly common<br />    more inclusive, participatory and transparent services<br />    New ways to solve sanitation challenges through mobile and IT technology<br />    Problem statements are needed<br /><br /><strong>Few Real life Samples -</strong><br /><br />    Farmers in Niger use mobile phones to find out which market is giving the best price<br />    People in Kenya pay their bills and send money home using M-Pesa.<br />    Bkash is a similar system in Bangladsh<br />    In India, the mobile phone is increasingly used in citizen election monitoring, and in equipping voters, via text message, with critical information on candidates.<br />    Another mobile application developed in India allows farmers to save water and time by remotely monitoring and switching on irrigation pumps used for watering crops.<br />    An application that enables an individual to donate money (from bank account, mobile money) for a toilet/ tap. Donors would be informed about the toilet tap they have paid for to connect the directly to the impact<br />    Tracking tool for community sewage disposal system in Egypt enabling households to coordinate the disposal of their sewage.<br />    Mobile application that helps pit emptiers plan their routes to improve their business and reduce unsafe dumping.<br />    New crowd-sourcing software developed by IBM allows cell phone users to monitor the health of local watersheds.</p>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";s:1:"1";s:10:"printintro";s:1:"0";}', 1, 1356890026);
